INSERT INTO `course` VALUES (1,4,0,NULL,1,2,0,3.5,'后周恭帝继位后，命赵匡胤为归德节度使，归德军驻扎在宋州（今河南商丘）。次年，赵匡胤在陈桥发动兵变即位，因其发迹在宋州，故国号曰“宋”，定都汴梁（今开封），靖康年间，金兵攻陷汴京，北宋遂亡。徽宗第九子赵构在临安（今杭州）重建宋王朝，史称“南宋”。',1,4,3.5,1,'汉语','upload/images/course/1/633989015519523750.jpg',NULL,1,'两宋风云',0,0,'2012-04-08 10:50:18','2012-04-07 16:00:00',3.8,NULL,1,1,1,3,NULL,3,3,NULL,NULL,NULL,1,NULL),(2,4.5,0,NULL,1,2,0,4.5,'塞北三朝的是大家不太熟悉的历史\r\n\r\n',1,4.5,4.5,1,'汉语','upload/images/course/2/201081816125095471.jpg',NULL,1,'塞北三朝',0,0,'2012-04-08 10:55:12','2012-04-08 16:00:00',4.5,NULL,1,1,1,3,NULL,3,3,NULL,NULL,NULL,1,NULL),(3,3,0,NULL,1,0,0,3,'乌敏岛是一个新加坡东北角的一个小岛，面积大概10平方公里，保留了原始森林本有的面貌。是一个值得一去的旅游景点。可以去探探险，感受一下。',0,3,3,1,'English','upload/images/course/3/Picture.JPG',NULL,1,'乌敏岛-原始热带雨林',0,0,'2012-04-09 12:02:25','2012-04-09 16:00:00',3,NULL,1,1,3,4,NULL,4,4,NULL,NULL,NULL,1,NULL),(4,3,0,NULL,1,0,0,3,'乌敏岛是一个新加坡东北角的一个小岛，面积大概10平方公里，保留了原始森林本有的面貌。是一个值得一去的旅游景点。可以去探探险，感受一下。',0,3,3,1,'English','upload/images/course/3/Picture.JPG',NULL,1,'乌敏岛-原始热带雨林',0,0,'2012-04-09 14:05:01','2012-04-27 16:00:00',3,NULL,1,1,3,4,NULL,4,4,NULL,NULL,NULL,1,NULL),(5,4,0,NULL,1,0,0,3.5,'乌敏岛是一个新加坡东北角的一个小岛，面积大概10平方公里，保留了原始森林本有的面貌。是一个值得一去的旅游景点。可以去探探险，感受一下。',1,4,4,1,'English','upload/images/course/3/Picture.JPG',NULL,1,'乌敏岛-原始热带雨林',0,0,'2012-04-09 14:20:43','2012-04-25 16:00:00',3.9,NULL,1,1,3,4,NULL,4,4,NULL,NULL,NULL,NULL,NULL),(6,3,0,NULL,NULL,233,1,3,'用你的眼睛看到另外一个世界',0,3,3,0,'Chinese','upload/images/course/6/34.jpg',NULL,NULL,'国画赏析',0,0,NULL,'2012-04-17 16:00:00',3,NULL,NULL,2,0,2,NULL,2,2,NULL,NULL,NULL,1,NULL),(7,3,0,NULL,1,233,0,3,'用你的眼睛看到另外一个世界',0,3,3,0,'Chinese','upload/images/course/7/34.jpg',NULL,1,'国画赏析',0,0,'2012-04-09 14:45:27','2012-04-10 16:00:00',3,NULL,1,2,6,2,NULL,2,2,NULL,NULL,NULL,1,NULL),(8,3,0,NULL,NULL,233,1,3,'dfdf',0,3,3,0,'Chinese','upload/images/course/8/8.jpg',NULL,NULL,'国画赏析',0,0,NULL,'2012-05-08 16:00:00',3,NULL,NULL,1,0,2,NULL,2,2,NULL,NULL,NULL,1,NULL),(9,3,0,NULL,NULL,1,1,3,'hhuyuh',0,3,3,0,'Chinese','upload/images/course/9