ULL,'人教版',6,'二年级'),(151,3,0,NULL,NULL,2,1,3,'《心理治疗学》50学时、《心理咨询学》35学时、《变态心理学》35学时、《爱情心理学》10学时、《管理心理学》30学时、《发展心理学》40学时、《社会心理学》35学时、《临床心理学》30学时、《普通心理学》35学时、《心理学研究方法》35学时、《西方心理学史》30学时等专业课程，以及箱庭疗法、催眠术、森田疗法、团体辅导、意象对话、精神分析、焦点短期心理咨询、家庭系统排列、绘画治疗、叙事疗法等30门心理治疗技术。',0,3,3,0,NULL,'upload/course/164/2012100713112082799.jpg',NULL,NULL,'应用心理学专业课程',0,0,NULL,'2012-10-09 16:00:00',3,NULL,NULL,4,0,NULL,NULL,164,164,151,NULL,'详见课程要求',3,'心理学专业学员、中小学心理健康中心教师、公安武警部队、企业管理人员、人事专员'),(152,3,0,NULL,NULL,0,1,3,'PUA，全称Pick-up Artist（把妹达人）。把妹达人，起初指的是一群受过系统化学习、实践、和不断自我完善泡学（把妹）技巧的男人。后来泛指在很会吸引异性，让异性着迷的男女。在字面上的解释，PUA指的是‘搭讪艺术家’，但因为泡学文化的变迁和进步，PUA的定义已经从简单的搭讪扩展到整个吸引流程，主要包括：搭讪（认识）、吸引、建立舒适和联系、到发生亲密关系。',0,3,3,0,NULL,'upload/course/167/images/defaultImgs/course.gif',NULL,NULL,'型男变身计',0,0,NULL,'2012-10-19 16:00:00',3,NULL,NULL,4,0,NULL,NULL,167,167,152,NULL,'《迷男方法》《迷上我》《大卫X方法》',6,'缺乏恋爱经验，不懂得谈恋爱的男人。'),(153,3,0,NULL,1,0,1,3,'初中劳技课是中学的必修课程。主要是如何培养种植蔬菜的技巧，培养孩子们的劳动意识。让他们懂得如何的尊重劳动！',0,3,3,0,NULL,'images/defaultImgs/course.gif',NULL,1,'初中劳技课',1,0,'2012-10-07 23:50:02','2012-10-07 16:00:00',3,NULL,1,4,1,NULL,NULL,169,169,153,NULL,'自编教材',4,'学生以及热爱劳动的所有“农民”。'),(154,3,0,NULL,NULL,1,1,3,'供三年级起使用的教材。',0,3,3,0,NULL,'images/defaultImgs/course.gif',NULL,NULL,'英语',0,0,NULL,'2012-10-07 16:00:00',3,NULL,NULL,4,3,NULL,NULL,170,170,154,NULL,'外研出版社',1,'8岁以上'),(155,3,0,NULL,1,0,1,3,'桥牌入门',0,3,3,0,NULL,'upload/course/168/2012100803251691580.jpg',NULL,1,'桥牌入门',1,0,'2012-10-08 03:28:57','2012-10-14 16:00:00',3,NULL,1,4,2,NULL,NULL,168,168,155,NULL,'',6,''),(156,3,0,NULL,NULL,0,1,3,'真爱没那么累。。。。\r\n幸福没那么贵。。。。',0,3,3,0,NULL,'upload/course/171/2012100805181565435.jpg',NULL,NULL,'如果你想幸福',0,0,NULL,'2012-10-07 16:00:00',3,NULL,NULL,NULL,5,NULL,NULL,171,171,156,NULL,'苏岑',6,'想要得到幸福'),(157,3,0,NULL,NULL,0,1,3,'gasdf',0,3,3,0,NULL,'upload/course/12/2012100805313181118.jpg',NULL,NULL,'组织创建课程合同测试',0,0,NULL,'2012-10-09 16:00:00',3,NULL,NULL,4,0,NULL,NULL,12,12,157,NULL,'《摄影的艺术》',1,'志同道合的大学生'),(158,3,0,NULL,1,0,1,3,'本教程向朋友们介绍CDRX4，教程介绍CDRX4的安装和界面的简单讲解，