,159,NULL,'',5,''),(167,3,0,NULL,NULL,0,1,3,'ssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssssss',0,3,3,0,NULL,'upload/course/2/2012101221491238981.png',NULL,NULL,'ssssssssssssssssssssssssssssssssssssssss',0,0,NULL,'2012-10-23 16:00:00',3,NULL,NULL,1,0,NULL,NULL,2,2,167,NULL,'ssssssssssssssssssssssssssssssssssssssss',3,'ssssssssssssssssssssssssssssssssssssssss'),(168,3,0,NULL,1,0,1,3,'欣赏各类美术作品，提高审美能力',0,3,3,0,NULL,'images/defaultImgs/course.gif',NULL,1,'美术欣赏',0,0,'2012-10-13 15:57:33','2012-10-14 16:00:00',3,NULL,1,3,1,NULL,NULL,187,187,168,NULL,'',6,'不限'),(169,3,0,NULL,1,0,1,3,'所有的结局都已写好 \r\n　　所有的泪水也都已启程 \r\n　　却忽然忘了是怎么样的一个开始 \r\n　　在那个古老的不再回来的夏日 \r\n　　无论我如何的去追索 \r\n　　年轻的你只如云影掠过 \r\n　　而你微笑的面容极浅极淡 \r\n　　逐渐隐没在日落后的群岚 \r\n　　遂翻开那发黄的扉页 \r\n　　命运将它装订的极为拙劣 \r\n　　含着泪 我一读再读 \r\n　　却不得不承认 \r\n　　青春 是一本太仓促的书',0,3,3,0,NULL,'images/defaultImgs/course.gif',NULL,1,'青春',0,0,'2012-10-13 16:15:23','2012-10-14 16:00:00',3,NULL,1,3,1,NULL,NULL,2,2,169,NULL,'',6,''),(170,3,0,NULL,NULL,0,1,3,'所有事，有趣的事，无聊的事，历史的事，未来的事，他们都有着联系，因此我们为“乱扯”找到了一个完美的借口，我们来回穿梭，思维跳跃，寻求内在的联系，似乎逻辑严谨，还有我们共同的问题。我所交代的只是一个世界观，不过如果你不盲从，或者只是想在女朋友面前变得更有趣，加入我们ok。\r\n课程预告\r\nc1.《李素丽 你漂亮吗》 “给我一支强心剂，操翻这个温和又卑鄙的世界，二十年后，摇滚在哪里呢？”\r\n\r\nc2.《元素周期表的猜想》“在哲学课上侃侃而谈的女生在被我鄙视之后最终没有拯救世界，东方哲学解决了形而上学的难题，完美的元素周期表是一个球体。”\r\n\r\nc3.《信仰的问题》“意志力这玩意儿到底存在吗？我看到的只是欲望和盲从，人居然和动物无异。”',0,3,3,0,NULL,'images/defaultImgs/course.gif',NULL,NULL,'《玻璃瓶、野生动物以及哲学和我们的问题》',0,0,NULL,'2013-10-31 16:00:00',3,NULL,NULL,4,16,NULL,NULL,188,188,170,NULL,'你不是正开着百度吗？',6,'人类 动物 植物'),(171,3,0,NULL,NULL,0,1,3,'每学时基本掌握一课的内容。学生能够主动根据课文内容，设置场景，进行会话。充分掌握了解国外的文化，思维方式。通过课堂讨论、汇报、复述、表演、游戏、演讲、辩论等各种富有创造性的语言实践活动，让学生扮演角色',0,3,3,0,NULL,'upload/images/course/85/GoGoWise Online.jpg',NULL,NULL,'全外教雅思口语1对1 VIP班',0,0,NULL,'2012-10-20 16:00:00',3,NULL,NULL,1,10,NULL,2,NULL,NULL,85,'sahilanilpatel@gmail.com','',1,''),(172,3,0,NULL,1,0,1,3,'熟悉自我介绍、吃惊、喜悦、时尚、后悔、同情等不同场景的各种表达。各个大主题又由具体场景构成教学时以场景练习为主，如购物、外出吃饭、开会，每学时基本掌握一课的内容。学生能够主动根据课文内容，设置场景，进行会话。充分掌握了解国外的文化，思维方式。通过课堂讨论、汇报、复述、表演