INSERT INTO `gogowiseannounce` VALUES (1,'未来的老师们，知元网正在搜寻优秀的网络实习老师！你 可以在知元网上免费创建属于你的课程。如果你的课程足够好， 学生足够多，你就有机会成为我们的明星网络实习老师。本学 期内，授课时间最多，注册上课学生最多的前五位将成为我们 的明星老师，本学期结束时，知元网将给每位明星老师一人一 个 Mini iPad 作为奖励！还在犹豫什么，开始创建你的课程吧。\r\n<br/>\r\n比赛规则\r\n\r\n新的学年开始了，知元网也正式上线运营了。为了感谢广大师生、用户对知元网的支持和厚爱，知元网特组织2012年知元网络教师大奖赛，优胜的5名用户将获得知元明星网络教室的称号，以及苹果的Mini iPad一部。规则如下：\r\n\r\n    1、 无须报名，用户可在知元网上开设一门自己的特色课程，课时、内容、教学大纲、课程的图标等自己设定，开课成功以后，自动获得参赛资格；\r\n    2、 课程可以多次开设，次数不受限制，招生人数不限；\r\n    3、 课程内容必须遵守国家的法律，严禁出现反华、反党等违法的言论；\r\n    4、 评判标准，课程评分4分及以上（5分满分），以课程学习的累计参与人•学时为标准，标记为T，计算方法以例说明：如某门课程为10个学时，招生上课的学生为100名，则这次课程累计的T为10×100=1000；\r\n    5、 比赛时间，2012年10月1日开始，至2013年1月31日止；\r\n    6、 在比赛期间内，课程累计T最多的前5门课程的开课用户为我们这期的优胜奖得主；\r\n    7、 严禁作弊，如只开课，不上课等，如果出现作弊的情况，取消比赛资格；<br/>\r\n    8、 比赛规则的解释权属于知元网。\r\n\r\n我们将定期公布课程累计情况，本学期结束以后，我们 将公布获奖情况， 我们将把 Mini iPad 通过邮寄的方式奖励给我们的明星网络教师。 希望广大教师以及在校学生的参与，尤其是师范类的学生参与!\r\n\r\n知元网\r\n\r\n2012年9月11日','upload/announce/null/2012092605360453276.jpg','2012-09-26 05:36:11','明星网络教师，Mini ipad 等你拿',NULL),(2,'<p>\r\n	<span class=\"hei14\">1、为什么我们是美国第一大债主，但要去优惠引进外资?<br />\r\n	<br />\r\n	问题背景：到2009年底，中国政府购买美国国债8000多亿美元，购买其他债券至少4000亿美元。连美国媒体都惊呼，中国成了世界最富强的国家最大债主。另一方面，中国各级政府的主要工作就是引资，每年都大力引进外资，根据国家统计公报，2008年引进外资924亿美元，到2008年底，29年来共引进外资8千8百多亿美元，根据国家工商总局通报，外资在中国资产到<br />\r\n	<br />\r\n	2007年底已经膨胀到2.11万亿美元。这种荒谬现象是怎么回事？<br />\r\n	<br />\r\n	2、到底物质财富是财富，还是美元欠条是财富?<br />\r\n	<br />\r\n	我们为什么宁愿拿物质财富低价贱卖，换来无法使用，越积越多，不断贬值的美元欠条？是不是将所有物质财富都送走了，换来无数美元欠条，就代表我们富裕了，我们的经济就发展了？问题背景：29年来(1980-2008)，我们人为降低人民币汇率，低价贱卖自己的物质财富，根据国际公认的购买力平价汇率法计算，我们总共拿价值40万亿美元物质财富，只换来6万亿美元商品加2万亿美元欠条，免费奉送32万亿美元(附录1)。由于我们一直贸易顺差，就没有机会在国内使用这些美元欠条，这些美元欠条还在不断增多。由于低价贱卖，我们如果拿美元欠条换回物质财富，换回的物质财富就会大幅度减少。到底是让老百姓保存价值34万亿美元的物质财富，还是让国家保存2万亿美元欠条更有利于我们的国家和老百姓？<br />\r\n	<br />\r\n	3、为什么我们有钱搞出口退税，但没钱将住房、教育和医疗推向市场化，让老百姓自己解决?<br />\r\n	<br />\r\n	问题背景：近年来，每年搞出口退税，让出口企业降低出口商品价格贱卖，等于补贴外国消费者，每年支出5000亿元人民币。另一方面，国家为了减少支出，将住房、教育和医疗推向市场化，让老百姓自己解决。为了增收，不断提高房价，使普通老百姓工作一辈子也买不起房子，辛苦工作都解决不了一家人基本生存问题。例如，由于技术进步，农业生产效率提高，国内从事农业的农民很少，大部分农民都进城打工，却无法成为城市居民。减免农业税，实际不过减少200亿元人民币，与出口退税补贴外国消费者根本无法相比。<br />\r\n	<br />\r\n	4、为什么我们将物质财富出口换美元欠条，然后在国内增发人民币?为什么不能根据经济发展需要直接在国内增发人民币?难道真正的物质财富还比不上不断贬值的美元欠条?<br />\r\n	<br />\r\n	问题背景：按照西方经济学理论，我们不能随意增发人民币，但是，中央银行可以增发人民币收购企业出口产品换的外汇，于是，企业出口物质财富获得外汇后，国内就增发了大量人民币购买企业的外汇。到2009年底，国家储备2.4万亿美元外汇，国内就增发了至少16万亿以上人民币。物质财富没有了，我们能增发人民币，物质财富在国内的时候，我们不能增发人民币，这是什么道理?根据西方经济学理论，据说是依据手里储备的美元增发的，可是美元实际购买力是不断下降的，40年来，按照黄金价格计算，贬值幅度超过90%。而且由于低价贱卖换来美元，使用美元换回物质财富时，换回的物质财富比卖出时要少得多。<br />\r\n	<br />\r\n	5、为什么不能增发人民币给老百姓，让国内资本家赚走，使国人皆大欢喜，而物质财富也都留在国内?非要将物质财富免费送到国外，人民币也奉送外国在中国的资本家，手里收点无法使用，不断贬值的美元欠条?<br />\r\n	<br />\r\n	问题背景：参见上个问题，笔者这里提出的是一个内需为主的经济发展路线，对比出口拉动发展经济的。两者唯一区别是内需路线是物质财富在老百姓手里，而外需路线是物质财富送到国外，国家免费奉送大量财富之后，拿着无法使用，不断贬值的少量美元欠条(存放1百年，恐怕1%原始价值都不到，99%都被美国人骗走了)。由于国外市场控制在外国人手里，出口企业大都被外资控制，海关统计资料也充分证明了这一点，因此出口物质财富，获得人民币的主要是外国在中国的资本家。到底这两种路线，那一种对国家和老百姓有利?西方国家发达的根本原因是提高老百姓收入，增大国内市场。没有市场，产品卖不掉，如何扩大生产，发展经济。<br />\r\n	<br />\r\n	6、企业和银行都交给外国人管理，这对中国有利吗?西方经济学理论基础就是人是自私的，一切都依靠外国人，靠得住吗?不知道你们家财产是否也交给外人来管理?<br />\r\n	<br />\r\n	问题背景：30年来，我们搞优惠引进外资，搞三减一免，减免外资各种税，出口产品还退税，使其处于竞争优势，在开放的21个行业，外资都彻底打败内资，成为外资一统天下。去年底还在布置外资兼并所剩无几的国企(附录2)。我们是否要将所有内资企业都消灭，企业都交给外资来管理?学过西方经济学的都知道，西方经济学理论基础就是人是自私的，将民生相关的企业都交给外国人，如果外国人要撤走怎么办?最近发生的谷歌撤退事件，你是怎么看的?现在维持工业企业的运行，在技术上都非常复杂，一个水厂，一个电厂，都由无数机器设备组成的，关键设备或零件少一个都开动不了，企业如果都让外国人管理，有一天，他们都撤走了，你能将其马上运转起来？<br />\r\n	<br />\r\n	7、自己的企业都卖给外国资本家，国人都当打工仔，能致富吗？到底是做老板能致富，还是做打工仔能致富？<br />\r\n	<br />\r\n	问题背景：去年底，精英们还在鼓励外资投资和并购所剩无几的国企，优先给予土地和信贷。将企业都卖给外资，国人只能当打工仔。在中国当打工仔，一个农民工，都无法在城市安家，大学生毕业即失业，更不用说致富了。这种方法能领导中国人民致富吗？<br />\r\n	<br />\r\n	8、为什么中国制定的银行法，不能借钱给自己的政府，而能借钱给敌视分裂中国的美国政府?<br />\r\n	<br />\r\n	问题背景：参见1995人大通过的中国银行法第29条规定，禁止央行借钱给自己的政府。但是我们可以看到，代表政府管理外汇储备的央行却购买美国国债8千多亿，借钱给美国政府。美国人炸中国大使馆，卖武器支持台湾分裂&hellip;&hellip;敌视中国是众所周知的。如果和美国发生战争，你会借钱给美国人买枪炮弹药枪杀消灭你?这是西方经济学理论指导下搞出来的荒谬法律。美国政府并不理睬这个理论，更不会立法束缚自己。08年美国危机期间，就大印美元7000亿给其救助的几家美国银行。我们为什么要采用这个荒谬理论来束缚自己?为什么看不到美日均从央行等大量借贷，甚至超过一年国民产值？<br />\r\n	<br />\r\n	9、由于引进外资的美元实际无法使用，等于免费将财富送给外国资本家办厂赚中国人钱，为什么不能印钱借给自己的老百姓办厂？<br />\r\n	<br />\r\n	问题背景：所谓引进外资，就是外国资本家拿一笔外汇，如美元到中国银行换人民币，在中国国内办厂。由于中国不使用从外资手里换来的美元，等于免费奉送财富给外国资本家办厂，而利润都归外国资本家。我们为什么不能借钱给自己的老百姓办厂，让利润归中国人，非要送给老外?正是我们压制老百姓收入，使企业利润微薄，又优惠引进外资，挤跨内资，使国内企业彻底倒闭。<br />\r\n	<br />\r\n	10、经济发展的目的是什么，是提高老百姓消费水平和生活质量，还是提高生产能力，增加产值和外汇储备?现在我国生产的物质财富完全满足国人需要，为什么要大量贱卖出口换取无法使用不断贬值的美元欠条，同时使国内大量老百姓温饱出现问题?<br />\r\n	<br />\r\n	问题背景：我们生产的粮食和肉类，按人均计算，超过日本人均消费量，达到发达国家水平(附录3)。我们建设的住房，按照人均计算，达到30平方米，也接近日本平均水平。我们生产的衣服供应了全世界，远远超过中国老百姓需要。可是，我们的老百姓收入和人均消费水平太低。根据国家统计局资料，我国有4.3亿人，平均一天消费量低于7.2元，不够一个人在普通城市吃一顿快餐。普通居民，一场大病，就会倾家荡产，成为贫民。我们到底是赚一堆美元欠条就万事大吉了，还是需要为老百姓分配足够的物质财富，解决老百姓衣食住行问题?任何时代，如果有一定比例的老百姓的基本生存成为问题，这个国家还能稳定发展吗?(历史上无数事实都表明，将导致社会崩溃。)由于老百姓收入低，消费能力低，生产的产品过剩严重，导致生产发展也难以增加，从而经济陷入停滞。国家于是搞低汇率出口，增加生产，免费奉送敌对国家财富32万亿美元，却不管国内老百姓缺衣少食，这实现了经济发展的目的?</span></p>\r\n',NULL,'2012-10-15 08:09:56','中国十大经济现象探讨',6),(3,'<div>\r\n	于本月初出炉的《美国新闻与世界报道》(U.S. News &amp; World Report)年度全美大学排行榜让我大跌眼镜，在这份榜单上，哈佛大学(Harvard)和普林斯顿大学(Princeton)并列第一。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	耶鲁大学(Yale)紧随二者之后。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	其后是哥伦比亚大学(Columbia)。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	这些大学不是不优秀，不过，想想吧！你真的能准确说出，普林斯顿大学有哪一点比哥伦比亚大学&ldquo;更好&rdquo;？排名第六的麻省理工学院 (Massachusetts Institute of Technology)究竟哪里比排名第十的加州理工学院(California Institute of Technology)更好？以及排名第28位的塔夫茨大学(Tufts)有哪一点比第33位的布兰迪斯大学(Brandeis)更好？</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	你当然不能。《美国新闻与世界报道》喜欢标榜，它使用了严谨的方法，可是，恕我直言，这只是一份由该杂志的编辑拼凑的名单。整个操作都有点儿愚蠢。甚至可以说，即便它现在还没带来什么害处， 但它一定会在将来造成恶果。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	杂志编辑排行榜，是因为人们喜欢阅读此类的内容。两年前，《美国新闻与世界报道》停止发行纸质杂志，编制排行榜&mdash;&mdash;不仅仅是大学排行榜，还包括法学院、 研究生院、甚至是高中排行榜&mdash;&mdash;可能是让这家企业得以存活的原因。人们非常在意它给出的排行榜，以至于愿意支付34.95美元（约合221.75元人民 币）到该杂志的网站上探寻细节。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	而且，它们还给这些排名赋予一种权威性，虽然这种权威性很难站得住。大学要想利用这些排名很容易。《美国新闻与世界报道》非常看重一所学校能筹集多少款项，又花掉了多少：包括花在教师队伍、小班授课，和学校设施等等方面的。它也很在意学校的录取过程有多挑剔。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	这样一来，一些大学原本是为和哈佛或耶鲁截然不同的学生群体提供服务的，但它们现在也开始追逐高中里的尖子生，美国高考(SAT)的高分学生。这些学校 知道，如果想要得到更靠前的排名，就需要疯狂地大笔撒钱，虽然这么做的结果是让原本已不堪重负的教学任务变得更加繁重。&ldquo;如果你想出了方法以更少的资金提 供一样的服务，你在《美国新闻与世界报道》上的排名就会下降，&rdquo;无党派调研组织新美国基金会(New America Foundation)教育政策负责人凯文&middot;凯里(Kevin Carey)表示。这些排名鼓励的趋势有悖于国家的发展。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	除此之外，这些排名还加剧了许多高中生对院校排名的焦虑。现在太多的中学生受到来自父母、辅导老师和社会本身的压力，一心想要进入一个&ldquo;好&rdquo;学校。那些 没能被一所名校录取的人会觉得自己是失败者。而那些被录取，但却没钱上学的人最后经常会背上沉重的贷款&mdash;&mdash;这负担可能会一辈子还不清。而《美国新闻与世界 报道》的排名差不多成了定义一个好学校的标准。&ldquo;《美国新闻与世界报道》没有创造这种社会潮流，&rdquo;凯里说，&ldquo;它所做的只是十分准确地加以实证主义的描 述。&rdquo;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	碰巧，在过去几年里，凯里也一直在为《华盛顿月刊》(The Washington Monthly)编辑一份不同的大学排名单。（20世纪70年代后期，我曾在《华盛顿月刊》做编辑。）《华盛顿月刊》的大学排名不是学校等级的参照标准， 而是从一些更有用的方面对学校进行评估：例如，社会流动性，或者是&ldquo;性价比&rdquo;。今年，在这个名单上排名靠前的全国性大学是加州大学圣迭戈分校 (University of California, San Diego) 和德州农工大学（Texas A&amp;M University）。这两所学校均没有进入《美国新闻和世界报道》排名的前30名。它们之所以上了《华盛顿月刊》的榜单，仅仅是因为考虑到其学生总数 这两所学校毕业生的数量超过了人们的预期&mdash;&mdash;而且教育费用很合理。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	是的，《华盛顿月刊》的排名 也只不过是杂志编辑整理的另一个单子，难免会有缺点。但该杂志想强调的是，我们应该鼓励这种高等教育模式。你能不同意吗？我毫不怀疑，你可以在德州农工大 学获得良好教育。正如在很多不在《美国新闻和世界报道》大学排名前列的教育机构里，你也肯定能获得好教育。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	不久前，我读到一位刚从史岱文森高中(Stuyvesant High)毕业的学生写的一篇文章。史岱文森被普遍认为是纽约最著名的公立中学，却刚刚发生了一起作弊丑闻&mdash;&mdash;很大程度上，正是学生觉得必须要进入一所名大学，才造成了这起丑闻。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	文章作者没有参与作弊，用她自己的话说，她被一所&ldquo;理想的大学&rdquo;所录取，但是她父母无法支付学费。最后，她进了一所州立学校，非常难过。她写到，每当有 人提起大学时，她总会&ldquo;含糊地表示不愿多讲，搪塞过去&rdquo;。尽管据她称，她已接受了自己的大学，但是在文章结尾，她发誓要攒很多钱，保证自己的孩子不会遭受 同样的命运。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	多么悲哀。也许有一天她会明白，去哪所大学读书远没有你在大学里的努力重要。或许，有一天《美国新闻与世界报道》大学排名的读者也能明白这一点。</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	作者：乔&middot;诺切拉　翻译：张薇、谷菁璐</div>\r\n',NULL,'2012-10-15 08:36:46','别被美国大学排行榜迷惑',6),(4,'<p>\r\n	Engine Alliance engine GP7000. Engine Alliance is a 50/50 joint venture<br />\r\n	between GE Aviation and Pratt &amp; Whitney.<br />\r\n	T.O. Thrust: 76,500 lbs/340N<br />\r\n	OPR (max climb): 45.6<br />\r\n	Fan Diameter: 116.7 in.<br />\r\n	Emissions:<br />\r\n	Nox: 59.7 g/kN<br />\r\n	UHC: 3.9 g/kN<br />\r\n	CO: 33.8 g/kN<br />\r\n	Noise: 22.9 dB Margin to Stage 3<br />\r\n	<img src=\"http://sphotos-g.ak.fbcdn.net/hphotos-ak-snc6/200782_1956713074682_7681742_n.jpg\" /><br />\r\n	<br />\r\n	<font size=\"3\">The <b>B-1B</b>: <b>Rockwell</b> (now part of Boeing) originally developed the <b>B-1 Lancer,</b> which is a four-engine variable-sweep wing strategic bomber used by the United States Air Force (USAF). It was first envisioned in the 1960s as a supersonic bomber with Mach 2 speed, and sufficient range and payload to replace the Boeing B-52 Stratofortress. It was developed into the B-1B, primarily a low-level penetrator with long range and Mach 1.25 speed capability at high altitude.</font><br />\r\n	<img src=\"http://sphotos-h.ak.fbcdn.net/hphotos-ak-ash4/208626_1956713274687_5320044_n.jpg\" /><br />\r\n	<br />\r\n	F35 Courtesy of Rolls-Royce.On 7 July 2006, it was officially named as the F-35: <i>Lightning II</i>, in honor of Lockheed&#39;s World War II-era twin-prop Lockheed P-38 Lightning and the Cold War-era jet, the English Electric Lightning (see below). English Electric Company&#39;s aircraft division was a predecessor of F-35 partner BAE Systems. Lightning II was also an early company name for its fighter that was later named the F-22 Raptor.<br />\r\n	<img src=\"http://sphotos-a.ak.fbcdn.net/hphotos-ak-snc6/199510_1956714834726_5092859_n.jpg\" /><br />\r\n	<br />\r\n	The RR Trent 1000: three-spool gas turbine engine is developed by Rolls-Royce.<br />\r\n	<br />\r\n	<img src=\"http://sphotos-h.ak.fbcdn.net/hphotos-ak-snc6/200122_1956715074732_1393097_n.jpg\" /><br />\r\n	<br />\r\n	A three-shaft turbine system developed by Rolls-Royce.<br />\r\n	<img src=\"http://sphotos-f.ak.fbcdn.net/hphotos-ak-ash4/207622_1958836367763_1841722_n.jpg\" /><br />\r\n	<br />\r\n	Turbine blade cooling.<br />\r\n	<img src=\"http://sphotos-h.ak.fbcdn.net/hphotos-ak-ash4/207304_1958836527767_7826729_n.jpg\" /><br />\r\n	<br />\r\n	The F119 engine is in vector thrust testing. It powers the F-22 Raptor.<br />\r\n	<img src=\"http://sphotos-b.ak.fbcdn.net/hphotos-ak-snc6/197482_1958836687771_2274760_n.jpg\" /><br />\r\n	<br />\r\n	<font size=\"3\">Performance testing of the Whittle jet engine, known as W1 on the experimental aircraft</font> <font size=\"3\">Gloster E28/29 that flew it in 1941.</font><br />\r\n	<img src=\"http://sphotos-c.ak.fbcdn.net/hphotos-ak-ash4/197009_1958836807774_6790212_n.jpg\" /><br />\r\n	<br />\r\n	Sir Frank Whittle, the father of aircraft jet engines.<br />\r\n	<img src=\"http://sphotos-e.ak.fbcdn.net/hphotos-ak-snc6/206927_1958836887776_646613_n.jpg\" /><br />\r\n	<br />\r\n	The first historic meeting between the two inventors (left: Hans-Joachim Pabst von Ohain; right: Sir Frank Whittle) of the jet engine took place in WPAFB on May 3 1978 (Courtesy AFRL/AFMC)<br />\r\n	<img src=\"http://sphotos-g.ak.fbcdn.net/hphotos-ak-snc6/207424_1958837047780_3611751_n.jpg\" /><br />\r\n	<br />\r\n	The first production jet aircraft, the German Messerschmitt Me 262. Two Jumbo 004B turbojet engines powered the Messerschmitt Me 262 jet fighter. The Me 262 first flight was on July 18 1942. Dr. Anselm Franz of the Junkers Engine Company designed the Jumbo 004, which was based on von Ohain&#39;s patent.<br />\r\n	<img src=\"http://sphotos-a.ak.fbcdn.net/hphotos-ak-snc6/196306_1958837607794_1769308_n.jpg\" /><br />\r\n	<br />\r\n	{C}<!----></p>\r\n<div align=\"justify\">\r\n	J-31: the first U.S. produced aircraft gas turbine engine (Courtesy of U.S. Air Force Museum). The jet engine comes from U.K. to the U.S. in 1941. It was the first turbojet engine produced in quantity in the U.S.. It was developed from the GE I-A, which itself was a copy of the highly secret British &quot;Whittle&quot; engine developed the Sir Frank Whittle.</div>\r\n<p>\r\n	<img src=\"http://sphotos-b.ak.fbcdn.net/hphotos-ak-snc6/199339_1958837647795_3823800_n.jpg\" /><br />\r\n	<br />\r\n	{C}<!---->F-22 being grounded.<br />\r\n	<img src=\"http://sphotos-c.ak.fbcdn.net/hphotos-ak-snc6/208063_1958842487916_6338384_n.jpg\" /><br />\r\n	<br />\r\n	{C}<!---->A modern jet engine with afterburner.<br />\r\n	<img src=\"http://sphotos-b.ak.fbcdn.net/hphotos-ak-snc6/207384_1958842607919_3943507_n.jpg\" /><br />\r\n	<br />\r\n	{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!---->{C}<!----></p>\r\n<p align=\"justify\">\r\n	The <b>Supermarine Spitfire</b> is a British single-seat fighter aircraft that was used by the Royal Air Force and many other Allied countries throughout the Second World War. The Spitfire continued to be used as a front line fighter and in secondary roles into the 1950s. It was produced in greater numbers than any other British aircraft and was the only British fighter in continuous production throughout the war.</p>\r\n<p align=\"justify\">\r\n	The Spitfire was designed as a short-range, high-performance interceptor aircraft by R. J. Mitchell, chief designer at Supermarine Aviation Works (which operated as a subsidiary of Vickers-Armstrong since 1928). Mitchell continued to refine the design until his death from cancer in 1937, whereupon his colleague Joseph Smith became chief designer. The Spitfire&#39;s elliptical wing had a thin cross-section, allowing a higher top speed than several contemporary fighters, including the Hawker Hurricane.Speed was seen as essential to carry out the mission of home defence against enemy bombers.</p>\r\n<p align=\"justify\">\r\n	During the Battle of Britain (July&ndash;October 1940), the Spitfire was perceived by the public as <i>the</i> RAF fighter of the battle, though the more numerous Hawker Hurricane shouldered a greater proportion of the burden against the <i>Luftwaffe</i>. The Spitfire units had a lower attrition rate and a higher victory-to-loss ratio than those flying Hurricanes.</p>\r\n<div align=\"justify\">\r\n	After the Battle of Britain, the Spitfire became the backbone of RAF Fighter Command, and saw action in the European, Mediterranean, Pacific and the South-East Asian theatres. Much loved by its pilots, the Spitfire served in several roles, including interceptor, photo-reconnaissance, fighter-bomber, carrier-based fighter, and trainer. It was built in many variants, using several wing configurations. Although the original airframe was designed to be powered by a Rolls-Royce Merlin engine producing 1,030 hp (768 kW), it was adaptable enough to use increasingly powerful Merlin and later Rolls-Royce Griffon engines; the latter was eventually able to produce 2,035 hp (1,520 kW).<br />\r\n	<img height=\"289\" src=\"http://sphotos-b.ak.fbcdn.net/hphotos-ak-snc6/227510_4665577954611_172199818_n.jpg\" width=\"802\" /></div>\r\n<div align=\"justify\">\r\n	<br />\r\n	The <b>English Electric Lightning</b> is a supersonic jet fighter aircraft of the Cold War era, noted for its great speed and unpainted metal exterior finish. It is the only all-British Mach 2 fighter aircraft and was the first aircraft in the world capable of supercruise. The Lightning was renowned for its capabilities as an interceptor; pilots commonly described it as &quot;being saddled to a skyrocket&quot;. Following English Electric&#39;s integration into the unified British Aircraft Corporation, the aircraft was marketed as the <b>BAC Lightning</b>.</div>\r\n<p>\r\n	{C}<!----><img src=\"http://sphotos-a.ak.fbcdn.net/hphotos-ak-prn1/26661_4665577314595_225206157_n.jpg\" /><br />\r\n	{C}<!----><br />\r\n	{C}<!----></p>\r\n<div align=\"justify\">\r\n	The <b>Avro Vulcan</b> (sometimes referred to as the <b>Hawker Siddeley Vulcan</b>) is a jet-powered delta wing strategic nuclear bomber, which was operated by the Royal Air Force (RAF) from 1956 until 1984. Aircraft manufacturer A V Roe &amp; Co (Avro) designed the Vulcan in response to Specification B.35/46. Of the three V bombers produced, the Vulcan was considered the riskiest option. Several scale aircraft, designated Avro 707, were produced to test and refine the delta wing design principles.</div>\r\n<p align=\"justify\">\r\n	The Vulcan B.1 was first delivered to the RAF in 1956; deliveries of the improved Vulcan B.2 started in 1960. The B.2 featured more powerful engines, a larger wing, an improved electrical system and electronic countermeasures (ECM); many were modified to accept the Blue Steel missile. As a part of the V-force, the Vulcan was the backbone of the United Kingdom&rsquo;s airborne nuclear deterrent during much of the Cold War. Although the Vulcan was typically armed with nuclear weapons, it was capable of conventional bombing missions, a capability which was used in Operation Black Buck during the Falklands War between Britain and Argentina in 1982.</p>\r\n<p>\r\n	{C}<!----><img src=\"http://sphotos-e.ak.fbcdn.net/hphotos-ak-snc7/598931_4665577074589_950422543_n.jpg\" /><br />\r\n	{C}<!----><br />\r\n	&nbsp;</p>\r\n<p align=\"justify\">\r\n	The <b>Hawker Siddeley Harrier</b>, known colloquially as the &quot;Harrier Jump Jet&quot;, was developed in the 1960s and formed the first generation of the Harrier series of aircraft. It was the first operational close-support and reconnaissance fighter aircraft with vertical/short takeoff and landing (V/STOL) capabilities and the only truly successful V/STOL design of the many that arose in that era. The Harrier was produced directly from the Hawker Siddeley Kestrel prototypes following the cancellation of a more advanced supersonic aircraft, the Hawker Siddeley P.1154. The Royal Air Force (RAF) ordered the Harrier GR.1 and GR.3 variants in the late 1960s. It was exported to the United States as the AV-8A, for use by the US Marine Corps (USMC), in the 1970s.</p>\r\n<p align=\"justify\">\r\n	The RAF positioned the bulk of their Harriers in West Germany to defend against a potential invasion of Western Europe by the Soviet Union; the unique abilities of the Harrier allowed the RAF to disperse their forces away from vulnerable airbases. The USMC used their Harriers primarily for close air support, operating from amphibious assault ships, and, if needed, forward operating bases. Harrier squadrons saw several deployments overseas. The Harrier&#39;s ability to operate with minimal ground facilities and very short runways allowed it to be used at locations unavailable to other fixed-wing aircraft. The Harrier received criticism for having a high accident rate and for a time-consuming maintenance process.</p>\r\n<p align=\"justify\">\r\n	In the 1970s the British Aerospace Sea Harrier was developed from the Harrier for use by the Royal Navy (RN) on <i>Invincible</i>-class aircraft carriers. The Sea Harrier and the Harrier fought in the 1982 Falklands War, in which the aircraft proved to be crucial and versatile. The RN Sea Harriers provided fixed-wing air defence while the RAF Harriers focused on ground-attack missions in support of the advancing British land force. The Harrier was also extensively redesigned as the AV-8B Harrier II and British Aerospace Harrier II by the team of McDonnell Douglas and British Aerospace. The innovative Harrier family and its Rolls-Royce Pegasus engines with thrust vectoring nozzles have generated long-term interest in V/STOL aircraft. Similar V/STOL operational aircraft include the contemporary Soviet Yakovlev Yak-38 as well as one variant of the Lockheed Martin F-35 Lightning II, which is currently under development.</p>\r\n<p>\r\n	<img src=\"http://sphotos-e.ak.fbcdn.net/hphotos-ak-snc6/254643_4665560034163_1224652727_n.jpg\" /><img src=\"http://sphotos-b.ak.fbcdn.net/hphotos-ak-snc7/486878_4665548033863_1814076358_n.jpg\" /><br />\r\n	<br />\r\n	CFD simulation of transonic flow and shock-boundary interaction over a Onera M6 Wing.<br />\r\n	<img src=\"http://sphotos-e.ak.fbcdn.net/hphotos-ak-ash3/554391_4665549873909_1564380705_n.jpg\" /><br />\r\n	<br />\r\n	&nbsp;</p>\r\n',NULL,'2012-10-15 08:41:03','   航空及推进系统和老照片',6),(5,'<p>\r\n	中国海监50船的电子屏上显示：钓鱼岛及其附属岛屿自古以来就是中国固有领土，中国对此拥有充分的历史和法律依据。你方对钓鱼岛及其附属岛屿采取的任何单方面措施都是非法的、无效的，你船的行为已经侵犯了中华人民共和国主权及主权权利，请你船立即停止侵权活动。否则你将承担由此产生的一切后果。图片来源：新华网</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139415F16470DT20121014123853.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139417F16470DT20121014124006.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9月14日早晨，在中国宣布《中华人民共和国政府关于钓鱼岛及其附属岛屿领海基线的声明》后，中国海监首次在钓鱼岛海域维权巡航执法。</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139418F16470DT20121014124046.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139419F16470DT20121014124131.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139420F16470DT20121014124215.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139421F16470DT20121014124234.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139422F16470DT20121014124319.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139423F16470DT20121014124339.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139424F16470DT20121014124439.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n<p>\r\n	　　<img border=\"0\" src=\"http://www.chinanews.com/tp/hd2011/2012/10-14/U86P4T426D139425F16470DT20121014124512.jpg\" style=\"width: 649px; height: 431.94px;\" /></p>\r\n<p>\r\n	　　9&middot;14巡航未公布照片</p>\r\n',NULL,'2012-10-15 08:45:00','中国海监巡航钓鱼岛及附岛未公布的照片曝光',6),(6,'<div id=\"postbody\" itemprop=\"articleBody\">\r\n	<div class=\"c1\">\r\n		<img src=\"http://img1.gtimg.com/news/pics/hv1/144/218/1168/76004934.jpg\" />\r\n		<p>\r\n			<br />\r\n			向中国三家企业提起反垄断诉讼，索赔15亿美元</p>\r\n	</div>\r\n	<p>\r\n		● Solyndra：中国组件制造商与中国的多晶硅生产商、金融机构和中国政府机构共同组成了卡特尔垄断组织</p>\r\n	<p>\r\n		● 中国公司：运营不善的的美欧公司对中国竞争者泼脏水俨然已成为时尚</p>\r\n	<p>\r\n		● 分析师：从时间点上看，Solyndra提起反垄断诉讼不排除有政治力量做幕后推手</p>\r\n	<p>\r\n		10月13日，根据外媒报道，一家名为Solyndra的美国光伏企业日前在美国加州北部地区的一家地区法院向中国最大的三家光伏制造企业尚德、英利和天合提起反垄断诉讼，声称这些公司的垄断行为给它造成15亿美元损失。</p>\r\n	<p>\r\n		对此，昨日，上述三家公司在接受记者采访时均表示，上述诉讼是没有根据的，公司将积极捍卫自己免受毫无根据的指控的投诉。</p>\r\n	<p>\r\n		针对中国光伏企业，美国商务部刚刚发布了高税率的终裁结果，为何美国光伏公司又开始&ldquo;落井下石&rdquo;？<br />\r\n		<br />\r\n		<b>Solyndra索赔15亿美元</b></p>\r\n	<p>\r\n		Solyndra是一家专业商用屋顶光伏系统制造商，以技术领先、设计新颖著称，是奥巴马政府重点扶持的美国能源创新样板公司。2009年，美国能源部向Solyndra提供了高达5.27亿美元的贷款担保，得到充沛资金的Sylyndra在短时间内迅速成长为业内冉冉升起的新星。《纽约时报》将它称之为&ldquo;政策制定者的甜心&rdquo;、&ldquo;风投的宠儿&rdquo;。</p>\r\n	<p>\r\n		去年5月，美国总统奥巴马还曾专门拜访Solyndra，并对该公司的产品设计赞不绝口，称Solyndra这样的光伏企业是&ldquo;保证美国经济增长当之无愧的引擎&rdquo;。</p>\r\n	<p>\r\n		然而，就是这样一家被寄予厚望的公司，于今年8月31日申请破产，1100名员工遭解雇。Solyndra在破产声明中将公司崩溃归咎于全球需求下降及竞争过于激烈等原因，特别是来自中国光伏同行的竞争。</p>\r\n	<p>\r\n		破产后一个月，Solyndra向中国光伏企业&ldquo;复仇&rdquo;。在近日一份编号为&ldquo;Solyndra LLC v. Suntech Power Holdings Ltd., 12-05272&rdquo;的诉讼案中，Solyndra指控中国组件制造商与中国的多晶硅生产商、金融机构和中国政府机构共同组成了卡特尔垄断组织，使得组件可以以低于成本的价格在美国销售。</p>\r\n	<p>\r\n		Solyndra认为正是受此影响公司才不得不进入破产程序，而公司现在将为此寻求补偿。据报道，Solyndra公司的律师称公司在被告垄断行为的影响下，营业损失达到15亿美元。</p>\r\n	<p>\r\n		对此，英利绿色能源美国公司总经理Robert Petrina表示已经收到被指控通知，通过对诉讼文件的初步审查发现，该指控毫无事实依据，并且具有误导性。</p>\r\n	<p>\r\n		&ldquo;事实证明，Solyndra的失败完全是由于技术落后和运营不善造成的。我们一定会积极抗辩，并相信英利能够获得最后的胜利。&rdquo;Robert Petrina表示。</p>\r\n	<p>\r\n		英利公司法务总监陈卓对此感叹称：&ldquo;运营不善的的美欧公司对中国竞争者泼脏水俨然已成为时尚。&rdquo;</p>\r\n	<p class=\"c2\">\r\n		后期恐追兵不断</p>\r\n	<p>\r\n		值得注意的是，Solyndra上诉时间正好在美国商务部公布终裁结果的后一天。一位不愿具名的光伏分析师对记者分析认为，Solyndra此时提起诉讼可能是想获得更多的赔偿，因为其是一家已经破产的公司，虽然中国在&ldquo;双反&rdquo;终裁中被判高税率，但Solyndra不能获得任何好处，因此，提起反垄断诉讼是其获得赔偿的一种方式，而且照目前的形势来看，赢面很大。</p>\r\n	<p>\r\n		不过，上述分析师也表示，从时间点上看，Solyndra提起反垄断诉讼不排除有政治力量做幕后推手。</p>\r\n	<p>\r\n		能源专家林伯强在接受《国际金融报》记者采访时则表示，Solyndra开了一个头，接下来会&ldquo;追兵不断&rdquo;，还会有更多的公司效仿其做法，未来中国光伏企业的日子可能更不好过，除了配合欧盟的调查，积极应诉之外，还要应付这些公司的纠缠。</p>\r\n	<p>\r\n		&ldquo;不过，这些企业间的诉讼都不是大事，不会对公司产生很大的影响，现在关键还是看对于中国光伏产品的反倾销调查欧盟到底怎么判。&rdquo;林伯强称。</p>\r\n	<p>\r\n		近期欧盟已经对中国光伏行业发起反倾销调查，而近期有消息还称，由欧洲25家太阳能面板企业组成的EU ProSun组织日前还向欧委会提起申诉，指控中国同业从非法补贴中获得不公平优势。</p>\r\n	<p>\r\n		林伯强认为，欧盟如果最终判出高税率，对中国光伏业来说将是致命一击，因此，在它没判决之前，中国政府应该尽快救产业。不过，他强调，救的不应该是企业，而是救市场，补贴终端，没有市场，给企业再多钱也是于事无补。</p>\r\n	<p>\r\n		值得注意的是，从目前的政策面看，救企业仍是政府的救市重点。日前，有媒体报道称，国家开发银行近日加强了光伏产业的金融信贷扶持，重点圈定赛维LDK、中能太阳能、尚德电力、英利、天合光能和晶澳太阳能等&ldquo;六大&rdquo;企业，以及阿特斯、晶科、阳光电源、中电光伏、新奥和昱辉阳光等&ldquo;六小&rdquo;企业，确保其授信额度</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2012-10-15 08:47:25','美国光伏企业破产 向三家中国企业索赔15亿',6),(7,'<p>\r\n	<img height=\"341\" src=\"http://news.xinhuanet.com/politics/2012-10/14/123819281_11n.jpg\" width=\"300\" /></p>\r\n<p>\r\n	&ldquo;红色密码&rdquo;之父曾希圣&mdash;&mdash;</p>\r\n<p>\r\n	　　长征期间，敌我双方都在大规模的行军途中，无线电通讯成为双方传递军情的主要联系方式。蒋介石或许没想到，自己部队电台发出的电文其实大多数都被红军截获破译，在长征途中，曾希圣带领军委二局(负责情报侦查工作)人员全天候监听敌军的电波信号，破译了国民党800多种不同电文密码版本，被红军领导人称是认识&ldquo;天书&rdquo;的人。日前，曾希圣的女儿曾小红、《曾希圣传》编纂委员会的研究成员陆德生，向记者讲述了曾希圣不为人知的情报工作历程。</p>\r\n<p>\r\n	　　<strong>白手起家，通宵达旦硬啃&ldquo;天书&rdquo;</strong></p>\r\n<p>\r\n	　　曾希圣于1904年出生于湖南兴宁，1927年加入中国共产党，早先参加无线电人员培训班学习，1930年担任上海中共中央军委谍报科科长，负责情报工作，曾获取了国民党第三次&ldquo;围剿&rdquo;中央苏区的军事计划等重要情报。</p>\r\n<p>\r\n	　　曾小红向记者介绍道：&ldquo;1932年红军在攻打赣州时失利，当时侦查的情报了解到赣州这一块的国民党军人员比较少，大概是三千多人，是可以打的。但没想到赣州北面国民党蒋介石嫡系5个师的精锐部队突然调动，迅速南下包抄了攻城的红军，红军在那次作战中伤亡很大。&rdquo;</p>\r\n<p>\r\n	　　此战过后，我军意识到，战场上军情瞬息万变，若能截获敌军的无线密电就能随时了解对方的动态，但国民党的电报内容都经过加密处理，报务员抄收的敌军电文虽然堆集了一大捆，也只能一筹莫展。一次，曾希圣认识的一位邮电局报务员告诉他：&ldquo;其实无线电的密码也有规律可循，是可以破译的。&rdquo;曾希圣听后眼前一亮，他向上级请示成立了电文破译小组。</p>\r\n<p>\r\n	　　破译小组成立后，曾希圣和曹祥仁、邹毕兆等几位人员开始了针对国民党电台的破译工作。他让收发员把来自不同方向的电波分别一一编号归类，最后搜集了整整两大箱加密过的电文，曾希圣他们几人就钻进房里没日没夜地研究起来。加密过的电文并无明显规律可循，一开始什么也看不懂，破译工作进展十分缓慢。</p>\r\n<p>\r\n	　　1932年8月，红军击败国民党在江西宜黄县的部队，曾希圣带人在敌师部的电台机房中搜查到一批遗留下来的加密电文，通过它大大提高了破译的效率。</p>\r\n<p>\r\n	　　曾小红回忆说：&ldquo;父亲和曹祥仁等人带回这批电文后仔细研究，最终找到一份已经翻译出了三十多个字的电文，他们把这30多个字作为线索，通过它们之间的规律、连贯的字词猜测大概意思，多次反复推敲后，最后硬是将这封&lsquo;天书&rsquo;般的加密电文猜译出来，由此打开了破译国民党密电的一个缺口。&rdquo;</p>\r\n<p>\r\n	　　经过一段时间的反复钻研，曾希圣同几位同志将国民党军的&ldquo;展密&rdquo;(一种密码代号)密码本贯通，敌军的情报源源不断地被送到红军指挥部，随着破译小组的作用日益凸显，中革军委决定成立军委二局，由曾希圣担任局长，曾希圣和另两个同志组成破译小组，专门负责破译敌人的电台密码。</p>\r\n<p>\r\n	　　到1933年7月，二局已成功破译敌军密码100多本，为红军第四次反&ldquo;围剿&rdquo;斗争的胜利作出了重要贡献。第四次反围剿胜利后，在红军建军6周年的纪念日上，曾希圣被授予二等红星勋章。</p>\r\n<p>\r\n	　　<strong>长征赶路，常常从马上摔下来</strong></p>\r\n<p>\r\n	　　电报内容屡次被破令蒋介石提高了警惕，国民党电台的密码每隔一段时间都会变换，军委二局的破译人员需要不断地破解新密码。曾希圣把二局的工作职能进一步细化，他带领一部分人专门搞破译工作，另一部分人专门负责接收敌军来自四面八方的电文，并让局里的每一台电台负责敌军对应的一个师或两个师，提高了破译敌方密码的效率。</p>\r\n<p>\r\n	　　&ldquo;由于经常通宵达旦地破译电文，父亲和二局的同志在行军中常常因过度疲劳被绊倒，或从马上摔下来，但他们克服了许多困难，破译了大量有价值的密电。&rdquo;曾小红说道。</p>\r\n<p>\r\n	　　1933年红军在登仙桥附近一举迁灭了国民党两个师的&ldquo;围剿&rdquo;部队，令国民党军队士气大受打击，国民党名将李默庵闻后心情低落，就用自己师部的电台秘密给在上海的夫人发了一首诗：&ldquo;登仙桥畔登仙去，多少红颜泪始干。&rdquo;这封电报被当时的二局截获，准确无误地破译出来，周恩来看后记住了这首诗。</p>\r\n<p>\r\n	　　1936年周恩来到西安处理西安事变时，见到了他的黄埔学生李默庵，周恩来想起他写的那首诗不错，随口就念了出来。李默庵听后大吃一惊：&ldquo;那是我密电给夫人的，你是怎么知道的？&rdquo;</p>\r\n<p>\r\n	　　为了不间断获悉国民党部队的动向，曾希圣把人员分成两支队伍，一支随着大部队先走，另一支留在原地架起信号设备，搜集电报信号。到了约定的时间后，行在前方的队伍停下来架设电台开始搜集电报，此时后一批人才停止工作赶上来，长征路上这两支队伍就这样一边随大队行进，一边负责破译工作。</p>\r\n<p>\r\n	<strong>假冒蒋介石密电，为红军顺利渡乌江争取了时间</strong></p>\r\n<p>\r\n	　　陆德生向记者介绍，1935年红军指挥部根据曾希圣二局破获的情报，采取了避实击虚灵活战术，带领红军在国民党40万人的围堵缝隙中穿插移动，在四渡赤水中争取了主动，走出了危局。</p>\r\n<p>\r\n	　　1935年3月，红军主力第四次渡过赤水河，南下抵达金沙县安底附近，准备南渡乌江。这时曾希圣和报务员从蒋介石调动军队的电文了解到，国民党的周浑元、吴奇伟2个纵队6个师部队正由安底西北一带往东南方向逼近红军主力，一天后很可能会与红军主力遭遇，同时在乌江南岸20余公里处，还有国民党军3个师的部队。红军主力要保证安全渡江至少要三天时间，双方部队若交锋，必然会是一场恶战。</p>\r\n<p>\r\n	　　当晚红军指挥部灯火通明，领导人员开了很长的会议研究对策。曾小红告诉记者：&ldquo;后来父亲在会议上提议，二局的破译人员对蒋介石电文的语言规律、用词都比较熟悉，能不能利用掌握的国民党军的口令和电文格式，假冒蒋介石密电，命令这两支部队改变行进路线，令他们晚些抵达安底一带，争取时间让红军渡过乌江。&rdquo;</p>\r\n<p>\r\n	　　这一提议得到上级的赞同，大家认为，只要电报内容不太过直白，国民党军应该不会察觉。根据指示，曾希圣让军委二局报务员以蒋介石的语气，向这两支部队发出了&ldquo;继续前进&rdquo;电令。假电报发出后，一直朝着东、南两个方向前行的国民党周浑元、吴奇伟部接获密电后深信不疑，部队果然没有改变方向，&ldquo;奉命&rdquo;继续向泮水、新场、三重堰方向前进，使得国民党部队的包围圈扩大，与红军保持着一定的距离。</p>\r\n<p>\r\n	　　三天后，红军顺利渡过乌江，队伍长驱南下甩掉了国民党20多万的堵截大军，避免了一场血战。&ldquo;后来这起假电报的事一直没有人提起，国民党内部可能也没有察觉。&rdquo; 曾小红道。</p>\r\n<p>\r\n	　　在艰苦的长征路上，曾希圣和曹祥仁等同志共破译国民党军各类口令860多种，红军领导人曾评价曾希圣领导的军委二局道：&ldquo;没有二局，红军长征是不可想象的，有了二局，我们就像打着灯笼走夜路。&rdquo;</p>\r\n<p>\r\n	　　<strong>曾小红回忆父亲：</strong></p>\r\n<p>\r\n	　　<strong>脾气急，但很严谨</strong></p>\r\n<p>\r\n	　　长征期间军情瞬息万变，但破译工作又非常繁琐耗时，曾希圣的压力非常大。在第四次反&ldquo;围剿&rdquo;的时候，行军遇到的环境特别艰苦，有一段时间整天都吃水煮竹子，没有盐，父亲看到就反胃，得了严重的胃溃疡，身体条件很差。曾小红告诉记者：&ldquo;父亲一急起来脾气就不好。他对工作要求很严格，一是一，二是二，容不得半点马虎，特别反感别人用&lsquo;可能、好像&rsquo;之类的词跟他说事。但生活中的他却十分随和，有空时就跟我们几个小孩一起玩游戏，我很少见过父亲骂人。&rdquo;</p>\r\n<p>\r\n	　　曾希圣直到去世都未曾向家人透露自己长征期间的情报工作经历，曾小红后来从父亲的老战友口中才逐渐知道父亲在长征期间的一些经历。&ldquo;父亲一直对自己在长征期间的工作经历守口如瓶，他从没跟我说过任何一点有关长征的事情。小时候我就听母亲说父亲走过长征，曾好奇地问父亲长征期间打过什么仗、是不是要吃野草、树皮，但父亲总是闭口不谈。&rdquo;曾小红说道。</p>\r\n',NULL,'2012-10-15 08:49:59','\"红色密码\"之父曾希圣：破译国民党各类口令860多种',6),(8,'<div class=\"c1\">\r\n	<img src=\"http://space.wenxuecity.com/_gallery/201210/6/1014174350.jpg\" /></div>\r\n<p>\r\n	<br />\r\n	　今年9月2日，网上一条题为《官员艳照门，怀化辰溪副县长豪赌玩女人》的帖子，出现在网易、天涯、华声论坛等多家网络社区。9月6日上午，湖南怀化市委宣传部进行了回应：网帖所附照片均采用图像编辑软件修改合成。</p>\r\n<p>\r\n	　　经过调查，近日，重庆警方在石柱县抓获了发帖的人，他是当地的一位教师，受雇于一个湖南网友充当&ldquo;水军&rdquo;。</p>\r\n<p>\r\n	　　网传官员豪赌玩女人艳照门</p>\r\n<p>\r\n	　　这个帖子里说，湖南怀化市辰溪县原县委常委、副县长龚某是有名的大赌徒，&ldquo;今年6月15~17日三天内，携带几十万现金赌博，且此人不仅有婚外情，还经常出入声色场所。&rdquo;并列出了龚某赌博的数家茶楼与酒店的名字。</p>\r\n<p>\r\n	　　此外，网帖还贴出好几张龚某的工作照，旁边放置了几张疑似龚某分别在赌场赌桌上，以及在房间里与女子亲热的照片，进行对比。</p>\r\n<p>\r\n	　　帖子发出后，几个论坛都十分热闹，迅速引起众多网友关注，跟帖的网友上万。</p>\r\n<p>\r\n	　　官方回应：艳照是电视剧剧照</p>\r\n<p>\r\n	　　9月4日的晚上，湖南怀化官方开始辟谣并作出回应，其中一份《关于网传&ldquo;湖南辰溪豪赌艳照门&rdquo;等帖配图资料的核查结果说明》出现在网上，落款为怀化市委网宣办。</p>\r\n<p>\r\n	　　这份说明里说：经初步核查，网传&ldquo;湖南豪赌艳照门&rdquo;等帖子中的&ldquo;豪赌&rdquo;原图为2009年6月，湖北省咸宁警方侦破一起赌博案件的宣传图片，是采用图像编辑软件修改合成的，而&ldquo;艳照&rdquo;则是曹颖、印小天主演的《律政佳人2》电视剧剧照。</p>\r\n<p>\r\n	　　说明后面，还附上了&ldquo;豪赌&rdquo;图片出处和&ldquo;艳照&rdquo;图片出处的链接。</p>\r\n<p>\r\n	　　这事在前期经过媒体报道后，当时湖南怀化市委宣传部回应说：&ldquo;网帖中的文字举报内容部分，纪检部门正在调查，目前还没有定论。&rdquo;对于发帖者，公安机关已介入调查。</p>\r\n<p>\r\n	　　经过湖南警方调查发现，发帖人在重庆石柱县，9月16日，石柱网警接到市公安局通知，要求协助湖南警方办理这起网络诽谤案件。</p>\r\n<p>\r\n	　　为赚500元 他收到材料就发帖</p>\r\n<p>\r\n	　　石柱网警迅速展开侦查，经过三天的摸排，石柱网警锁定了石柱籍犯罪嫌疑人宋某，并初步还原了宋某的犯罪事实，9月20日，石柱警方在宋某家中抓获他。</p>\r\n<p>\r\n	　　宋某今年57岁，是重庆石柱县人，家住石柱县南宾镇线市街。他是一名网络&ldquo;水军&rdquo;，专门帮网友发帖挣钱。</p>\r\n<p>\r\n	　　他说，在8月中旬，一个叫&ldquo;愤怒&rdquo;的网友通过网络联系到他。&ldquo;愤怒&rdquo;对他说，他们那里的一个领导&ldquo;经常卡厂子的油&rdquo;，要求他帮忙在几个大型的网站发帖，把这个领导的名声搞臭。</p>\r\n<p>\r\n	　　宋某随即答应，两人约定价钱是500块，分两次付清。&ldquo;愤怒&rdquo;通过QQ将诽谤官员龚某的相关文字材料和PS过的豪赌照片和艳照发给了宋某。</p>\r\n<p>\r\n	　　随后，宋某就开始在家里通过网络进行操作，不仅发帖，还以不同的网名跟帖100条。</p>\r\n<p>\r\n	　　警方透露，被抓时，宋某并没有意识到发帖诽谤他人已构成违法，目前，宋某因涉嫌造谣诽谤被警方采取强制措施控制，湖南网友&ldquo;愤怒&rdquo;也正在被当地警方调查，案件正在进一步侦办中。</p>\r\n',NULL,'2012-10-15 08:51:06','重庆教师为500元当网络水军 PS发布官员艳照(图)',6),(9,'<p>\r\n	　</p>\r\n<div class=\"c1\">\r\n	<img border=\"0\" src=\"http://img5.cache.netease.com/cnews/2012/10/15/20121015074526cde21.jpg\" />\r\n	<p>\r\n		　　西哈努克和夫人</p>\r\n</div>\r\n<p>\r\n	　　诺罗敦&middot;西哈努克（Norodom Sihanouk）（1922-），柬埔寨王国前国王。1922年10月31日生于金边，1941年4月23日即位，1955年让位于其父，1960年出任国家元首。因郎诺政变、红色高棉执政而长期流亡中国，受到毛泽东、邓小平等礼遇。1993年9月24日，柬埔寨恢复君主立宪制，西哈努克再次成为国王。2004年10月7日正式宣布退位，目前因健康问题长期侨居北京接受治疗。</p>\r\n<p>\r\n	　　西哈努克是柬埔寨王族诺罗敦&middot;苏拉玛里特之子，出生于柬埔寨首都金边。1941年，外祖父西索瓦&middot;莫尼旺国王病逝，正在越南西贡市留学的西哈努克回国继承王位。</p>\r\n<p>\r\n	　　当时，柬埔寨王室分为两支，分别是奉诺罗敦王（在位1840年 -1904年）为始祖的诺罗敦家系和以西索瓦王为始祖的西索瓦家。西索瓦&middot;莫尼旺国王驾崩之后，两个家族为继承权争执不休，最后在当时实际控制柬埔寨的法属印度支那总督的裁定之下、才最终决定由西哈努克继位。</p>\r\n<p>\r\n	　　在柬埔寨，西哈努克原本希望能够在越南独立的同时发表本国的独立宣言，但由于国内各方联络不畅，结果在越南独立的两天之后即4月13日，柬埔寨才得以独立。</p>\r\n<p>\r\n	　　西哈努克对此状况无法满意，并在离宫发表了&ldquo;在完全独立达成之前绝不返回首都金边&rdquo;的宣言，终于使得全国范围内的反法示威运动达到高潮。为国王强硬姿态所震惊的法国最后承认了柬埔寨的完全独立，1953年11月9日，新生的柬埔寨王国成立，西哈努克也在国民的欢呼声中返回金边的王宫，被国民尊为&ldquo;独立之父&rdquo;。</p>\r\n<p>\r\n	　　西哈努克于1955年3月3日将王位让予其父诺罗敦&middot;苏拉玛里特，同年4月7日，组建政治团体并担任总裁。退位后的西哈努克被国民称呼为&ldquo;殿下&rdquo;。体于同年的总选举中获得压倒性胜利，控制了国会中全部议席，西哈努克则出任首相并兼外交大臣。1960年3月，苏拉玛里特国王去世，在王位空缺的情况下，西哈努克又就任新设的&ldquo;国家元首&rdquo;之职，成为柬埔寨的最高政治领袖。</p>\r\n<p>\r\n	　　西哈努克将自己的政治理念称为&ldquo;佛教社会主义&rdquo;：在佛教的保护和君主制的体制下实行社会主义式的政策。</p>\r\n<p>\r\n	　　1970年3月、首相兼国防大臣朗诺将军和副首相施里玛达殿下（西哈努克的表兄弟）趁西哈努克在北京国事访问期间发动政变，议会解任了西哈努克国家元首的职位，决议废止君主制、建立共和制的高棉共和国，朗诺就任总统。西哈努克被迫流亡中国。</p>\r\n<p>\r\n	　　流亡的西哈努克暂住在中国北京，并组建了以打倒朗诺政权为诉求的流亡政府&ldquo;柬埔寨王国民族联合政府&rdquo;。尽管西哈努克并不喜欢自己过去曾经打压的波尔布特派，但在中国领导人毛泽东、周恩来以及朝鲜领导人金日成的说服下，终于与波尔布特结成统一战线。</p>\r\n<p>\r\n	　　西哈努克名义上虽然是统一战线的领袖，但是对于以彻底破坏封建体制为目标的波尔布特及其党人来说，西哈努克及其政治理念实则与己方水火不容。已而，双方的关系自联盟结成之始就处于紧张状态。</p>\r\n<p>\r\n	　　1975年，红色高棉终于占领柬埔寨全境，朗诺政权崩溃。西哈努克以国家元首的身份宣布共产主义国家民主柬埔寨成立，并由平壤归国。在民主柬埔寨执政期间，西哈努克表面上是国家的最高领导人，但并无任何实权，日常生活除去由柬共安排的地方视察之外，即是被软禁在王宫之中。被允许与西哈努克共同居住的，仅有其第六位夫人莫尼克王妃和两位王子、以及为数很少的侧近侍从。至于其他尚留在国内的王室成员则被全体流放至地方，西哈努克的五个儿子和十四个孙子在此过程中被虐杀。甚至在一段时期，西哈努克自身都身处被处决危险之中，只是在中国政府向波尔布特政府施压后才幸免于难。此后西哈努克以患病为由希望能够出国疗养，但遭到政府拒绝。1976年4月，西哈努克辞去国家元首之职，并被幽禁在王宫中，与外界失去联系。</p>\r\n<p>\r\n	　　2004年10月29日西哈努克国王再次退位，王子诺罗敦&middot;西哈莫尼继位。现时西哈努克身体状况不佳，正往返于中国与柬埔寨之间接受治疗。</p>\r\n',NULL,'2012-10-15 08:52:03','西哈努克生平：因红色高棉执政长期流亡中国(图)',6),(10,'<p class=\"c1\">\r\n	<img border=\"0\" src=\"http://space.wenxuecity.com/_gallery/201210/news/rdn_507b670421c67.jpg\" /><br />\r\n	<br />\r\n	蛇群过马路<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://space.wenxuecity.com/_gallery/201210/news/rdn_507b6703ddc45.jpg\" /><br />\r\n	<br />\r\n	蛇群过马路</p>\r\n<p>\r\n	原标题：吉林：蛇群横穿公路专家称系寻觅越冬地<br />\r\n	<br />\r\n	中新网长春10月14日电(记者刘权尹)近一段时间，吉林省九台市与永吉县交界处一道山岭上，不时有蛇群横穿公路，最多时有上百条不同类的蛇出现。对此，当地野生动物专家称，这是蛇在寻觅越冬地，是正常现象。<br />\r\n	<br />\r\n	据目击者张姓村民介绍，几天前的一个上午，这条公路上出现了大量的蛇。一百米以内，最少得有六七十条蛇，最大的两米多长，小的六十公分左右。<br />\r\n	<br />\r\n	据了解，此路段是长春到吉林的重要交通枢纽，过往车辆较多。当地村民介绍，司机发现路上有蛇以后，大都把车停了下来，让蛇先通过，但仍有个别的蛇被压死在路中。<br />\r\n	<br />\r\n	对于群蛇上路的异常现象，当地村民既感到好奇又有些恐慌。有村民表示，很多年都看不到这么多蛇了，听说这事就来看看。<br />\r\n	<br />\r\n	群蛇同时上路，会不会给人带来威胁呢？对此，吉林市野生动物保护协会的专家唐景文介绍，这些蛇都是吉林地区常见的蛇类，比较大的黑蛇叫棕黑锦蛇，老百姓俗称松花蛇；红色带黑点的叫火赤炼蛇，老百姓叫赤炼子。还有一种叫红点锦蛇，这些蛇均无毒。除了这三种蛇以外，还有一种老百姓称为野鸡脖子的蛇，老百姓很惧怕这种蛇。此蛇学名叫虎斑劲曹蛇，也是无毒的，这几种蛇对人类来说都比较安全。<br />\r\n	<br />\r\n	到底什么原因会让这么多蛇同时出现在一个地方，又同时迁移呢？唐景文表示，蛇在这个季节大量爬行，主要是寻找越冬地，所以遇到这种现象不要惊慌，也不是什么其他的预兆。</p>\r\n',NULL,'2012-10-15 08:53:52','吉林上百条蛇横穿公路 当地村民恐慌(组图)',6),(11,'<p style=\"text-align: left; text-indent: 2em;\">\r\n	&ldquo;长征七号运载火箭被称为&lsquo;数字火箭&rsquo;，将成为我国未来中型火箭的基础构型，承担未来大部分的发射任务。&rdquo;这是今年年初中国航天科技集团公司一院有关领导向外界透露的一个重要信息。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	被誉为未来中国运载火箭主力的&ldquo;长七&rdquo;，身上究竟有怎样的&ldquo;数字化&rdquo;光环？为此，本报记者到负责&ldquo;长七&rdquo;总体设计的一院一部进行了探访。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	打通&ldquo;数字火箭&rdquo;设计制造的&ldquo;任督二脉&rdquo;</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	如果说长征五号运载火箭是中国运载火箭史上首次采用数字化设计的火箭，那么它的&ldquo;同门师弟&rdquo;&mdash;&mdash;&ldquo;长七&rdquo;则将数字化技术发扬光大，成为中国运载火箭史上首发实现全寿命周期数字化的火箭。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	所谓全寿命周期数字化，是指将数字化贯穿设计、试验、制造、管理的全过程，这对火箭研制方式来说，是一种从普通公路到高速公路式的跨越。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	即使在欧美发达国家，产品全数字化设计制造也是一道难题，但数字化所创造的超高效益却是有目共睹的。在号称&ldquo;玩转数字化&rdquo;的航空领域，波音公司从B737－X到B777研制都实现了全过程的数字化定义、预装配、并行设计、协同流程管理，设计方法更改和返工减少了50%，研制周期缩短了50%。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	而在火箭研制领域，实施产品全数字化设计制造也带来了意想不到的效果。如今，通过各研制单位的紧密配合，一部已打通&ldquo;长七&rdquo;数字化设计生产研制的&ldquo;任督二脉&rdquo;,突破多项关键技术，完成初样箭体结构20个部段的&ldquo;全三维下厂&rdquo;，有望在5年内实现首飞。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	火箭在建立了全箭三维数字样机后，以数字模装替代实物模装，完成全箭的装配及接口协调工作。技术人员只需在电脑前应用软件，就可对火箭的可靠性进行一次&ldquo;摸底考试&rdquo;。&ldquo;这次通过全箭三维数字装配，我们发现了60余项问题，不仅提高了产品可靠性，更节省了大量的人力、物力、财力。&rdquo;一院总体部运载总体室副主任陈风雨说。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	&ldquo;仅仅实现设计层面的数字化并不难，难的是将数字化辐射到火箭的设计、模装、试验、生产制造的全过程。&rdquo;一院一部八室副主任聂蓉梅告诉记者，光靠局部工作的数字化，是无法释放其真实能量的。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	依照传统研制流程，三维的设计模型一旦到达加工制造环节，就需要换成二维图纸进行加工，不仅浪费时间，更容易在设计、制造的转换过程中出现错误。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	&ldquo;打通三维数字化制造这个环节势在必行。&rdquo;一部结构室的郑卫东认为长征五号火箭实现了全三维模型设计，&ldquo;长七&rdquo;则要以三维设计下厂的方式完成产品三维工艺设计，达到真正意义上的高效、高质和快捷。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	为了满足三维数字化制造的基本需求，一院211厂和703所还分别自筹经费购置了一批基础硬件设施，对几个主要车间进行了网络改造工作，彻底将数字化制造工作落实到设计工艺协同、三维设计文件的使用与管理、工艺设计、数字化生产、数字化检测的各个环节，力图实现三维到工艺、三维到现场、三维到设备的完整数字化制造体系。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	一场需要&ldquo;全民皆兵&rdquo;的技术革命</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	&ldquo;产品数字化将意味着我们的管理也要跟得上脚步。&rdquo;聂蓉梅说。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	&ldquo;如果维持传统的工作流程，数字化只是建立数字模型、单台设备的数字加工而已。&rdquo;陈风雨告诉记者，现在一院打破各单位&ldquo;单兵作战&rdquo;的局面，把各系统的设计师组成一个设计组，形成协同工作的团队，集中在统一的工作现场，通过网络在50个图形工作站之间及时传递进展情况和反馈意见，把目前大多按串行流程进行的工作尽可能同步、甚至提前进行，直接在三维模型上进行设计、工艺以及协同，大大缩短了数据传递的时间和传递的路径。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	然而，任何新生事物在初期都需要一个适应过程，型号数字化工作也是如此。比如，设计人员为使211厂在接收到数字设计模型后能准确地进行加工制造，就需要对每个三维图形进行标注。&ldquo;每个三维图形的尺寸，我们都需要花费2个～3个小时进行标注。按照传统模式，1个月就能完成的工作，现在光标注就要花费近4个月的时间。在设计阶段，我们的效率反而降低了。&rdquo;郑卫东坦言。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	另外，&ldquo;和木桶理论一样，研制各环节的参研单位，数字化能力水平参差不齐，也会对型号的研制效率带来负面影响。&rdquo;聂蓉梅认为，只有迈过这道坎，才能实现长久的高效。</p>\r\n<p style=\"text-align: left; text-indent: 2em;\">\r\n	正如我国航空航天领域专家顾颂芬院士所说，&ldquo;数字化的生产方式正在从根本上动摇着传统制造业的基础，催生着一场制造业的技术革命。&rdquo;很显然，中国航天正在悄然掀起一场火箭制造业的新革命。(中国航天网 杨蕾)<br />\r\n	&nbsp;</p>\r\n',NULL,'2012-10-15 08:54:43','长征七号火箭获重大突破！',6),(12,'<div style=\"width: 545px; magin: 0 3px;\">\r\n	<img border=\"0\" src=\"http://chinese.wsj.com/photo/MK-BX806_HUAWEI_F_20121008153204.jpg\" style=\"width: 545px;\" /><br />\r\n	<div style=\"text-align: right; color: rgb(102, 102, 102); font-size: 10px;\">\r\n		Getty Images</div>\r\n	<br />\r\n	<div style=\"color: rgb(199, 75, 21); font-size: 12px;\">\r\n		众议院情报委员会主席罗杰斯（左）与众议员Dutch Ruppersberger。</div>\r\n</div>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; border: 0px solid rgb(0, 0, 0); width: 28px; color: rgb(199, 75, 21); line-height: 140%; font-size: 28px; font-weight: bolder; float: left;\">\r\n	中</div>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	国电信业巨头华为技术有限公司(Huawei Technologies Co.)周一对一份尖锐的美国国会报告作出了激烈的反击。该报告指控华为存在对美国民众从事间谍活动和违反美国法律的行为。而华为则说，这些指控只不过是诋毁中国的做法。<br />\r\n	<br />\r\n	华为和另一家中国电信设备制造商中兴通讯股份有限公司(ZTE Corp.<span class=\"dj-ticker\" data-charting-symbol=\"CN:000063\" data-ticker-name=\"CN:000063\"> </span><span class=\"ticker-quote ticker-quote-cn_000063 ticker-quote-negative-change\" jquery1349807098843=\"172\"><span class=\"ticker-name\">CN:000063</span><span class=\"ticker-change\">-0.44%</span></span>)发起了全球行动，对众议院情报委员会的结论予以反击。众议院情报委员会的这份报告警告美国公司不要与这两家公司合作。</p>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	众议院情报委员会的报告得出的结论是，因这两家公司的设备可能被中方用来针对美国民众进行间谍活动，所以会给美国国家安全带来风险。报告还指责华为存在行贿和违反移民法律的行为。<br />\r\n	<br />\r\n	由于华为和中兴正努力在美国建立信誉，这些结论为这两家公司向发达国家市场扩张的计划构成了新的阻碍。这份报告不仅破坏了两家公司的公众形象，还有可能引发针对它们业务的进一步调查。<br />\r\n	<br />\r\n	众议院情报委员会主席、密歇根州共和党议员罗杰斯(Mike Rogers)在周一发布这份报告时又对两家公司发起了新的指责。他说，研究小组收到了无数有关华为的设备从事可疑行动的报告，比如，把美国公司的数据发送给中国──这个过程被称做&ldquo;信标&rdquo;(beaconing)。罗杰斯说，委员会将于周二把报告中发现的问题，以及两家公司可能存在的其他违法行为的信息递交给联邦调查局(Federal Bureau of Investigation)。<br />\r\n	<br />\r\n	这份报告以及公司受到刑事调查的可能性让华为公司的高管大为震惊。华为高管说，这份报告是旨在攻击中国的政治行为。<br />\r\n	<br />\r\n	华为的首席发言人普卢默(William Plummer)在华盛顿说，华为已经成了那些对中国心存戒备的美国人的出气筒。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<div style=\"margin-right: 6px; float: left;\">\r\n	<img border=\"0\" src=\"http://chinese.wsj.com/photo/MK-BX807_HUAWEI_DV_20121008153239.jpg\" /><br />\r\n	<div style=\"margin: 2px 0px 4px; text-align: right; color: rgb(102, 102, 102); font-family: Arial; font-size: 11px;\">\r\n		Agence France-Presse/Getty Images</div>\r\n	<br />\r\n	<div style=\"width: 265px; color: rgb(199, 75, 21); font-size: 12px;\">\r\n		华为首席发言人普卢默</div>\r\n</div>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	普卢默说，委员会的调查结果是预先确定的。他说，其政治目的是把一家无辜、独立、由员工拥有的公司当作人质，并以此抨击中国。<br />\r\n	<br />\r\n	华为说，该公司配合了美国国会的调查，提供了有关公司财务状况和董事会的信息。但是这份报告则表达了对华为不肯合作的失望。普卢默说：但是这次，我们做好了准备。<br />\r\n	<br />\r\n	华为预计到了报告将会对公司发起激烈抨击，因此在数周之前就开始进行部署。这家公司上个月开始安抚客户，并启动了一个提供华为系统安全信息的网页。<br />\r\n	<br />\r\n	普卢默说，上周，华为向所有员工发送了一则通知，针对可能出现的报告对员工加以提醒。通知中说，他们预计这份报告将让一些错误信息更长久的存在。通知强调，华为在全世界的客户可以证明，华为在全球普遍获得了信任。<br />\r\n	<br />\r\n	周日晚间，在报告发布之前，华为的高管们召开了一个电话会议。他们敲定了一篇准备发表在网站上的博客文章，精心准备了计划提供给媒体以及向员工和客户发布的信息。<br />\r\n	<br />\r\n	周一，华为向员工发送了第二则通知，并开设了媒体专线，以重申公司要传达的信息，华为还主动与客户联系，以消除他们的疑虑。<br />\r\n	<br />\r\n	普卢默说，报告中并没有有关华为存在非法活动或危及美国安全的证据。他说，包括截获数据在内的部分指控并不十分明确，华为无法对此做出回应。<br />\r\n	<br />\r\n	罗杰斯拒绝提供有关&ldquo;信标&rdquo;等活动的详情，但说美国众议院情报委员会了解到的这些情况仍令人担忧。罗杰斯说，这足以让最支持华为与中兴通讯进入美国电信网络的人感到担心。他说，这是对一些人来说非常敏感、非常私人的数据，在有些情况下可能还很珍贵，而这些数据现正被传到中国。<br />\r\n	<br />\r\n	&ldquo;信标&rdquo;是植入间谍软件的术语，该软件可将信息发回给软件的主人，并等待新指示。&ldquo;信标&rdquo;有时也被更广泛地用来描述可将数据发回的渗入性网络。<br />\r\n	<br />\r\n	普卢默说，他只知道一例华为设备工作异常的情况。他说，对那个案例进行了两份独立评估，结果表明是一名华为员工用笔记本电脑登陆某酒店网络时，意外染上病毒。在病毒的作用下，当他的电脑与客户网络连接的时候，便发起了所谓的&ldquo;拒绝服务攻击&rdquo;。<br />\r\n	<br />\r\n	普卢默说，周一发布的这份报告措辞极为强烈，但却空洞无物，华为明确否认报告中的指控。<br />\r\n	<br />\r\n	华为是世界第二大电信企业。这家少数人持股的公司在150个国家开展业务，在美国的雇员达1,700人。去年，华为在美国的业务规模为13亿美元。<br />\r\n	<br />\r\n	中国驻美国大使馆发言人耿爽在华盛顿说：中国企业在美国的合法投资有助于中美双方的经济发展和扩大就业，我们希望美方能公平、公正地促进中国公司在美国本土的投资和经济活动。<br />\r\n	<br />\r\n	相比之下，美国众议院情报委员会的报告对中兴通讯的态度要略好一些。报告没有指责中兴通讯存在任何不法行为，但警告美国企业不要从该公司采购设备。去年，中兴通讯的美国销售额为3,000万美元。<br />\r\n	<br />\r\n	中兴通讯采取的姿态相对没那么强硬，只是强调自己努力配合美国众议院情报委员会的调查。<br />\r\n	<br />\r\n	中兴通讯全球公关负责人戴澍说：值得注意的是，在经过长达一年的调查后，美国众议院情报委员会得出的结论是，中兴通讯可能难免会受到政府影响。他说：这样的调查结果适用于所有在华经营的企业，该委员会并未怀疑中兴通讯服务美国市场的合理性，不认为我们存在任何不道德或违法行为。<br />\r\n	<br />\r\n	另外，中兴通讯周一说，由于美国指中兴通讯向伊朗出售设备，思科系统(Cisco Systems Inc.<span class=\"ticker-quote ticker-quote-csco ticker-quote-negative-change\" jquery1349807098843=\"173\"><span class=\"ticker-name\">CSCO</span><span class=\"ticker-change\">-0.26%</span></span>)中断了与中兴通讯的战略合作协议。中兴通讯的发言人周一说，几天前思科曾告知中兴通讯，将结束与这家总部位于深圳的中国公司的战略伙伴协议。该协议约在2005年订立，其中包括转售思科生产的设备。<br />\r\n	<br />\r\n	戴澍说，自己并不知悉思科所提的具体原因。但他说：我们知道这与伊朗和美国政府审查中国在伊朗的生意有关。<br />\r\n	<br />\r\n	思科发言人恩哈特(John Earnhardt)说，思科现在和中兴通讯没有关系。<br />\r\n	<br />\r\n	Jefferies分析师Cynthia Meng说，对于华为而言，该美国委员会的调查限制了其未来几年的发展潜力。<br />\r\n	<br />\r\n	她说，美国电信运营商和其他美国公司将难以选择华为或中兴作为供应商。<br />\r\n	<br />\r\n	巴克莱分析师顾永贤(Jones Ku)说，对华为和中兴来说最糟糕的情况是，该委员会的报告促使欧洲各国政府也基于对安全风险的担忧发起类似调查。他说：我不排除欧洲进行调查的可能性。顾永贤研究的对象包括在香港上市的中兴，但不包括华为，后者为私人持股公司。<br />\r\n	<br />\r\n	今年春季，澳大利亚出于国家安全担忧，阻止华为参与竞标该国370亿美元的宽带网络相关合约。<br />\r\n	<br />\r\n	华为和中兴去年在印度的销售也遭遇打击。印度政府以安全为由，为电信设备的销售设置了障碍。<br />\r\n	<br />\r\n	同样在去年，欧盟委员会(European Commission)在调查后发布报告，指责华为和中兴得益于中国政府的大量支持。报告说，中国政府的支持令这两家公司可以更轻松地参与竞争。两家公司否认接受了这种帮助。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<div style=\"margin-right: 6px; float: left;\">\r\n	<img border=\"0\" src=\"http://chinese.wsj.com/photo/OB-UW491_1007hu_D_20121007223432.jpg\" /><br />\r\n	<div style=\"margin: 2px 0px 4px; text-align: right; color: rgb(102, 102, 102); font-family: Arial; font-size: 11px;\">\r\n		REUTERS</div>\r\n	<br />\r\n	<div style=\"width: 265px; color: rgb(199, 75, 21); font-size: 12px;\">\r\n		一部华为手机。</div>\r\n</div>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	虽然华为在美国获得了与小型电信公司合作的一些业务，但出于国家安全方面的担忧，华为一直被排除在美国主要电信供应商网络之外。<br />\r\n	<br />\r\n	美国众议院的报告说，华为向委员会提供了其在美国最大客户的名单。其中包括提供Cricket电话服务的无线供应商Leap Wireless International Inc.、无线宽带网络运营商Clearwire Corp.以及有线电视公司Cox Communications和康卡斯特(Comcast Corp.)<br />\r\n	<br />\r\n	Leap和竞争对手MetroPCS Communications Inc.出售华为的智能手机。不过委员会报告并未指出与智能手机相关的任何风险。<br />\r\n	<br />\r\n	美国最大的两家电信公司美国电话电报公司(AT&amp;T Inc., T)和Verizon Communications Inc.没有在其网络中使用华为的设备。运营商的管理人员私下里曾说，他们能够管理安全风险，但也知道因政治方面的担忧而带来的限制。<br />\r\n	<br />\r\n	2010年初，美国第三大无线运营商Sprint Nextel Corp.将华为和中兴排除在一份价值数十亿美元的合约之外。当时熟悉情况的人士说，这一举措在很大程度上是由于华盛顿方面的国家安全担忧。<br />\r\n	<br />\r\n	去年9月，美国商务部以国家安全担忧为由，阻止华为参与一个全国性无线应急网络的竞争。<br />\r\n	<br />\r\n	这些排斥之举令华为遭受了损失。2011年4月，华为首席营销长指责美国和印度等重要市场的竞争对手阻止华为在全球扩张，并说保护主义将导致当年收入增长急剧放缓。据华为说，去年该公司向运营商销售设备这一核心业务同比仅增长3%。<br />\r\n	<br />\r\n	不过还是有其他一些西方电信公司使用华为的设备。总部位于巴黎、在33个国家开展业务的运营商France Telecom-Orange的首席执行长理查德(Stephane Richard)说，他的公司在法国本国的核心网络不使用华为的设备，但在比利时、英国、西班牙和非洲部分地区的业务一直在使用华为设备。<br />\r\n	<br />\r\n	理查德说，他们的研发很令人钦佩。<br />\r\n	<br />\r\n	<i><b>SIOBHAN GORMAN / JURO OSAWA</b></i><br />\r\n	<br />\r\n	华尔街日报网络版供稿并保留版权：未经许可，不得转载摘编</p>\r\n',NULL,'2012-10-15 08:56:02','华为激烈反击美国会报告(组图)',6),(13,'<div class=\"artInfo\">\r\n	<span id=\"art_source\"><a href=\"http://sports.sina.com.cn\">http://sports.sina.com.cn</a></span>&nbsp;&nbsp;<span id=\"pub_date\">2012年10月25日00:33</span>&nbsp;&nbsp;<span id=\"media_name\"><span class=\"linkRed02\"><a href=\"http://sports.sina.com.cn\" target=\"_blank\">新浪体育</a></span></span><a class=\"weibo-card-dropdown\" href=\"http://weibo.com/sportschannel?zwm=sports\" id=\"media_weibo\">微博</a></div>\r\n<div class=\"img_wrapper\">\r\n	<img alt=\"贾巴尔和霍华德惺惺相惜\" src=\"http://i0.sinaimg.cn/ty/nba/2012-10-25/U2035P6T12D6269529F44DT20121025003638.jpg\" /><span class=\"img_descr\">贾巴尔和霍华德惺惺相惜</span></div>\r\n<p>\r\n	　　新浪体育讯　北京时间10月25日消息，《体育画报》本周封面故事的主人公是德怀特-霍华德，作者詹金斯也在文中透露，霍华德曾因为得到贾巴尔的肯定，流下了激动的泪水。</p>\r\n<p>\r\n	　　其实贾巴尔和湖人<a href=\"http://weibo.com/lakersnews?zw=sports\" target=\"_blank\">(微博)</a>的关系始终有些微妙，他曾抱怨过不受湖人的重视，包括在指导拜纳姆的问题上，以及自己的雕像迟迟无法在斯台普斯中心外被树立。</p>\r\n<p>\r\n	　　而霍华德与贾巴尔却找到了惺惺相惜的感觉，在霍华德来到湖人三周的时候，贾巴尔曾给霍华德展示了冠军戒指，并鼓励他说：&ldquo;你有威尔特-张伯伦和比尔-拉塞尔一般的天赋，你在过去的八年中付出了很多的努力，已经播下了成功的种子，现在到了收获的时候了。&rdquo;</p>\r\n<p>\r\n	　　而当贾巴尔离开的时候，霍华德也抑制不住内心的激动流下眼泪，他得到了内心深处渴望的被认同感：&ldquo;我所经历的一切，所有的痛苦他都理解。我实在太高兴了，他知道我曾多么的努力过。&rdquo;</p>\r\n<p>\r\n	　　其实不只是贾巴尔，科比也曾对新队友表示过无条件的支持，尤其是在霍华德和沙克-奥尼尔前不久打嘴仗的时候。曾经流传的霍华德不愿意加盟湖人的说法，部分原因也是霍华德不想让人们认为，他是模仿奥尼尔的轨迹。</p>\r\n<p>\r\n	　　不过詹金斯认为霍华德和&ldquo;魔术师&rdquo;约翰逊比较更合适些，而不是和奥尼尔。魔术师也曾饱受质疑，因为他曾逼宫恩师韦斯特海德，两人也从此形同陌路。如今霍华德和大范甘迪的恩怨也已经告一段落，他要开始书写在湖人的新篇章了。</p>\r\n<p>\r\n	　　(勒色)</p>\r\n',NULL,'2012-10-25 02:21:47','霍华德曾因“天勾”鼓励落泪 经历更似“魔术师”',1),(14,'<div id=\"postbody\" itemprop=\"articleBody\">\r\n	<p class=\"c1\">\r\n		<img border=\"0\" src=\"http://space.wenxuecity.com/_gallery/201210/news/rdn_5087e4900b7e6.jpg\" /><br />\r\n		<br />\r\n		网传浙江温岭女教师虐童照片</p>\r\n	<p class=\"c1\">\r\n		知元互动直播，是否能有效的避免此类事情的发生？</p>\r\n	<p>\r\n		原标题：浙江温岭虐童幼师系无证上岗称行为出于&ldquo;好玩&rdquo;<br />\r\n		<br />\r\n		中新网台州10月24日电(记者邵燕飞实习生吴佳蔚)24日，浙江省温岭市发生一起幼儿园教师虐童事件。事发后不久，该教师虐待班上幼儿全过程的视频在网上被曝光，一时间众网友声讨不断。<br />\r\n		<br />\r\n		据了解，此事发生在浙江温岭城西街道蓝孔雀幼儿园，是一所民办学校。该校教师颜艳红因&ldquo;一时好玩&rdquo;在该园活动室里强行揪住一名幼童双耳向上提起，同时让另一名教师用手机拍下，之后该视频被上传到网上。<br />\r\n		<br />\r\n		记者在视频中看到，被揪耳幼童双脚离地近20厘米，表情痛苦，嚎啕不止。相反，颜艳红神情愉悦，乐在其中。<br />\r\n		<br />\r\n		事发当天，温岭市教育局接到被虐幼童家长举报，立即赶赴该幼儿园进行调查。并采取了向公安部门通报，以及联合城西街道办事处发出通知，责成校方深刻检查、整改并立即辞退相关教师等举措。<br />\r\n		<br />\r\n		此前知情人士爆料称颜艳红从事教师职业系无证上岗，该情况目前已被证实无误。<br />\r\n		<br />\r\n		对此，温岭市教育局副局长滕林华接受中新网记者采访时称，按有关规定，不论公办或民办学校，教师必须持证上岗。<br />\r\n		<br />\r\n		不过，滕林华随即表示因当地幼儿园存在师资紧缺情况，幼师实际持证率仅为40%，为弥补师资不足，幼儿园基本实行&ldquo;先上岗、后考证&rdquo;。&ldquo;民办幼儿园在教师招聘中有自己的实权，其教师存在的职业素养问题，教育管理部门无法负责。&rdquo;<br />\r\n		&nbsp;</p>\r\n	<p>\r\n		<img border=\"0\" class=\"c2\" src=\"http://space.wenxuecity.com/_gallery/201210/news/re_5087dbf925cba.jpg\" /><br />\r\n		<br />\r\n		<img border=\"0\" class=\"c2\" src=\"http://space.wenxuecity.com/_gallery/201210/news/re_5087dbf9ae800.jpg\" /><br />\r\n		<br />\r\n		据网友@将讲090080：这是发生在温岭城西街道中心幼儿园（也就是牛津国际幼儿园）的一幕。这个老师自己发出的照片，不久前删了，她说她没老师资格证就进去了。</p>\r\n	<p class=\"c1\">\r\n		<img border=\"0\" src=\"http://space.wenxuecity.com/_gallery/201210/news/re_5087dbfb17d99.jpg\" /><br />\r\n		<br />\r\n		当地教育局发文处理&ldquo;幼师拎儿童耳朵&rdquo;事件</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2012-10-25 02:37:59','浙江女老师被曝虐童：揪住男童双耳上提使其悬空(图)',1),(16,'<p>\r\n	中共十八大被定于11月8日举行，未来十年的国家领导人会发生巨大变化。<br />\r\n	<br />\r\n	这里列举了8个原因&mdash;&mdash;在中国&ldquo;8&rdquo;是一个吉利的数字&mdash;&mdash;为什么世界应当关注在北京人民大会堂那个&ldquo;密道&rdquo;中所发生的一切。<br />\r\n	<br />\r\n	<strong>致富光荣</strong></p>\r\n<p>\r\n	35年了。35年前，前国家领导人邓小平提出这个振奋人心的口号，标志着中国开始对世界开放，之后就迎来了人类历史上最大的经济传奇之一。</p>\r\n<p>\r\n	中国，从经济比意大利还弱小，成长为世界第二大经济体，现在还是100万个百万（美刀）富翁的家乡。新一代领导人接过权力之后，到2022年，中国将对美国的头把交椅构成挑战。</p>\r\n<p>\r\n	这种翻天覆地的变化已经改变了世界商业运行的方式。从皮鞋，到拖把，再到手机，廉价的中国劳工使西方的每一件商品都降价了。中国是非洲的最大的投资者，誓将两个世纪以来的焦点从欧美首次转移到非洲。而且中国还是美国国债的最大债主&mdash;&mdash;这是掌握了一个把柄，还是一次鲁莽的赌注？</p>\r\n<p>\r\n	关键问题是，新领导人是否能在保持经济如过去那般高速增长的同时，还帮助世界其它成员复苏。大多数西方分析家预计中国经济增长速率会从每年10%降至依然很高的6-7%，但同时指出，中国如果准备变得比中等收入国家更富裕，就需要更深层次的改革。<br />\r\n	<br />\r\n	增长会产生出世界上最大的中产阶级，他们渴望享受诸如汽车和空调这样的生活用品，而不管环境会付出怎样的代价。<br />\r\n	<br />\r\n	<strong>天下没有不散的筵席</strong><br />\r\n	<br />\r\n	中国增长得太迅速，几乎不会停下来思考环境付出的代价。<br />\r\n	<br />\r\n	局面是严峻的。快速的工业化和房地产的繁荣见证了2007年中国取代美国，成为了世界上最大的温室气体排放国。七个世界上污染最严重的城市均在中国，这引起了每年50万至75万例过早死亡。</p>\r\n<p>\r\n	环境破坏并不仅局限在中国境内。空气污染包括汞污染和铅污染正突破边界进入邻国，还漂洋过海，降落在美国的西海岸上。</p>\r\n<p>\r\n	中国的领导人似乎决心要清理最严重的污染，但如此大规模的任务将非常艰巨。</p>\r\n<p>\r\n	&ldquo;如果你观察它的经济规模和环境污染，单单这两个因素就会显示中国有多复杂。&rdquo;亚洲发展银行的埃德加&middot;库亚说。<br />\r\n	<br />\r\n	这意味着中国于对未来任何与气候变化有关的协定都至关重要。它拒绝限制自己的温室气体排放，而选择降低&ldquo;碳强度&rdquo;&mdash;&mdash;单位经济产出所排出的碳&mdash;&mdash;到2020年降至40-50%。然而，经济增长如此之快，中国需要的能源有70%依赖于煤炭，即使降低碳强度的目标已达到，温室气体排放仍然会从当前的水平上升至60%。<br />\r\n	<br />\r\n	<strong>教孩子说普通话？</strong></p>\r\n<p>\r\n	中国长久以来就吸引着西方，但是作为一股经济力量出现的中国发现其文化和语言引起了日益高涨的兴趣。</p>\r\n<p>\r\n	三十年前，只有神秘的国家领导人才被西方所知。现在诸如女演员章子怡、篮球运动员姚明和艺术家张晓刚都已是全球化的人物。</p>\r\n<p>\r\n	与此同时，遍及欧美的学校为小到六岁的儿童开办汉语普通话的班级，而且，在奥运会期间，中国汉字出现在伦敦巴士的广告上。</p>\r\n<p>\r\n	中国政府试图抓住时代精神，在全球范围内建立数百所孔子学院，以教授中文为公开目标，也意在增强软实力。<br />\r\n	<br />\r\n	说汉语普通话的人数正在迅猛增长，尤其是在亚洲，但它真的能对作为全球化语言的英语构成挑战吗？近期不会，大多数专家指出，汉语普通话以其耗时良久才能熟练使用的发音和书写令人抓狂。<br />\r\n	<br />\r\n	<strong>维持和平</strong><br />\r\n	<br />\r\n	<img border=\"0\" class=\"c1\" src=\"http://i50.tinypic.com/2007f3d.jpg\" /><br />\r\n	<br />\r\n	中国采用了所谓&ldquo;和平崛起&rdquo;的说法，试着让紧张的邻国相信它新近出现的经济影响力不会形成霸权。<br />\r\n	<br />\r\n	但是与日本、菲律宾和越南的领土纠纷&mdash;&mdash;以及和美国之间蓄势已久的紧张局面&mdash;&mdash;时而让这句话变成一纸空文。<br />\r\n	<br />\r\n	中国人民解放军是世界上最大的军队，达三百万之巨，且官方预算正在迅速扩大。中国的第一艘航空母舰已开始服役，它被认为在隐身技术、空间战争和网络安全上作了巨额投资。中国方面称，这是一个有如此规模和影响力的国家自然而然的发展，并不象征着它改弦易辙。<br />\r\n	<br />\r\n	&ldquo;每个国家都必须捍卫自己的安全和领土主权，但这并不意味着我们就必须变得富有侵略性，这会让你孤立无援，甚至失去你的朋友。&rdquo;前驻法大使吴建民说。<br />\r\n	<br />\r\n	然而真正的问题在于中国新的国家领导人对美国会采取何种政策。他们更年轻，对外部世界更有经验，因此，他们能否在竞争对手的军队中祛除那种根深蒂固的怀疑？历史告诉我们，一个超级大国与它新兴的挑战者之间的摩擦是不可避免的，且会导致更为紧张而非缓和的局面。<br />\r\n	<br />\r\n	<strong>下一个登上月球的是中国人？</strong><br />\r\n	<br />\r\n	<img border=\"0\" class=\"c1\" src=\"http://i45.tinypic.com/21jpouc.jpg\" /><br />\r\n	<br />\r\n	中国共产党在1949年掌握政权之前，把整个20世纪都描绘成饱受西方凌辱的时期。因此中国太空计划的成功标志着中国重新恢复了自己的国际地位。<br />\r\n	<br />\r\n	但鉴于1.5亿中国人民日收入尚不及1美元，这样的巨额花费引发了争议。已将一艘无人驾驶飞船送入月球卫星轨道的中国宣称，2013年将发射首个探测器登上月球，同时提及把中国人送上月球的初步计划，但没有明确的日期。<br />\r\n	<br />\r\n	如果这个计划继续进行，传遍全世界卧室的电视画面就会再次向美国高扬起中国挑战的旗帜，而美国，正是这个世界上最强大的太空势力。<br />\r\n	<br />\r\n	<strong>大象、犀牛、蝠鲼、猪&hellip;&hellip;的末日</strong><br />\r\n	<br />\r\n	<img border=\"0\" class=\"c1\" src=\"http://i48.tinypic.com/34osytf.jpg\" /><br />\r\n	<br />\r\n	新近富裕的中国人正遭受着谴责，因为他们出于药物、装饰、食用的需要，助长偷猎濒危动物。<br />\r\n	<br />\r\n	每年，数以千计的非洲大象因中国雕刻家所追求的象牙而被猎杀，中国政府因其没有适当管制止象牙贸易而受到批评。<br />\r\n	<br />\r\n	问题在于，经济改革既使得亿万人摆脱了贫困，也造就了贪得无厌的消费者。<br />\r\n	<br />\r\n	猪肉消费很好地反映了这一现象。如今中国的猪肉消费比1979年多五倍，数量占世界总量一半的、4.6亿头猪都生于斯、长于斯。<br />\r\n	<br />\r\n	考虑到土地资源短缺，饲养这么多猪是不可能的。因此农民们求助于进口大豆，这些大豆占世界大豆出口总量60%以上。于是，每件商品的价格都被推高了，同时加剧了比工业环境污染更严重的真正的恐慌。<br />\r\n	<br />\r\n	未来，由于中国试图以全世界9%的耕地养活全世界21%的人口，压力会越来越大。一些专家相信，我们都将不得不习惯高价食品，也不得不习惯中国农民在海外购买越来越多的土地。<br />\r\n	<br />\r\n	<strong>读万卷书，不如行万里路</strong><br />\r\n	<br />\r\n	就是近在1995年，在中国申请一张用于出国的护照就要花掉6个月的时间来通过有关部门的审查，且这些申请还大多是官方的。<br />\r\n	<br />\r\n	现在只需要几天就能办好，百万之多的中国人开始利用政府的开放政策，以游客或是学生的身份周游五湖四海。<br />\r\n	<br />\r\n	中国游客现在是世界上第三大挥金如土的消费群体，仅次于德国和美国。相比1995年的450万，2011年有7千万中国人去海外旅行。<br />\r\n	<br />\r\n	大部分游客走得不远，去一些近的地方，诸如香港、澳门和泰国。但越来越多的游客前往美国或法国，还有一些不太知名的目的地，如特里尔，卡尔&middot;马克思的诞生地。在巴黎的塞纳河游船上，景点是依次以不同的语言来介绍的，汉语普通话现已排在了日语前面。<br />\r\n	<br />\r\n	每年大概有30万中国学生出国留学，特别是在美国和澳大利亚的大学里。他们想在回国之后凭着一种接受过海外教育的光环，找到一份更好的工作。也有一些学生把出国留学当作逃避中国国内难度很大的高考的一种方式。<br />\r\n	<br />\r\n	<strong>买下地球</strong><br />\r\n	<br />\r\n	<img border=\"0\" class=\"c1\" src=\"http://i45.tinypic.com/10n9phv.jpg\" /><br />\r\n	<br />\r\n	中国创造的财富正在包围世界。<br />\r\n	<br />\r\n	中国的需求已引起诸如铜这样大宗商品的价格上涨&mdash;&mdash;飞速发展的城市和基础设施建设的需求。<br />\r\n	<br />\r\n	也许最惊人的影响是&mdash;&mdash;有人可能称之泡沫&mdash;&mdash;对中国艺术的影响。2011年售出的10幅最贵的画作中，有3幅是中国艺术家的作品，包括一幅最贵的，5720万美元的齐白石的作品。<br />\r\n	<br />\r\n	下一阶段我们可能会看到中国的工业巨头开始在海外寻找新的市场和新的专业知识。<br />\r\n	<br />\r\n	这也许会引起争议，因为大部分工业巨头都由中国共产党控制。在电信和能源这样的领域内，他们可能会威胁到与西方的贸易，产生贸易纠纷。</p>\r\n',NULL,'2012-10-25 07:11:39','英媒：中国以这样8种方式改变世界(组图)',1),(17,'<p>\r\n	<br />\r\n	&nbsp;</p>\r\n<div style=\"padding: 0px; text-indent: 2em;\">\r\n	<a href=\"http://z.t.qq.com/mb/qzone/index.html#mod=profile%26account=zhoulibofans\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none;\" target=\"_blank\"><font color=\"#0000ff\" size=\"4\" style=\"line-height: 32px;\"><b>周立波</b></font></a><font color=\"#000000\" size=\"4\" style=\"line-height: 32px;\"><b>：一百多年前有这么一群人：他们抵制洋货，自己同胞点一盏洋油灯都可能遭其毒手；他们烧教堂、杀教士、攻击使馆，也残害本国同胞，所过之处无不残破；他们自信刀枪不入，战无不胜，临敌却不堪一击；他们自称忠臣，其实是忠于一个颟顸无能的政府，后来却惨遭政府杀戮；更重要的是，这群人一直活到了今天。</b></font><br />\r\n	&nbsp;</div>\r\n<div align=\"center\" style=\"padding: 0px; text-indent: 2em;\">\r\n	<a href=\"http://t1.qpic.cn/mblogpic/03a717bce315edde17f6/460\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none; outline-style: none;\" target=\"_blank\"><img src=\"http://t1.qpic.cn/mblogpic/03a717bce315edde17f6/460\" style=\"border-width: 0px; max-width: 100%;\" /></a><br />\r\n	<br />\r\n	<br />\r\n	<div align=\"center\" style=\"padding: 0px; text-indent: 2em;\">\r\n		<a href=\"http://t.qq.com/JokeGenius\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none;\" target=\"_blank\"><font color=\"#0000ff\" size=\"4\" style=\"line-height: 32px;\"><b><span class=\"yshortcuts\" id=\"lw_1350296601_2\">周立波</span></b></font></a><font color=\"#000000\" size=\"4\" style=\"line-height: 32px;\"><b>：做为一只狗，一定要跟对主人，否则也要受牵连。</b></font></div>\r\n	<div align=\"center\" style=\"padding: 0px; text-indent: 2em;\">\r\n		<a href=\"http://t1.qpic.cn/mblogpic/55a4bed109f959ca2d62/460\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none; outline-style: none;\" target=\"_blank\"><font color=\"#000000\"><var id=\"yiv2012238323yui-ie-cursor\"><img src=\"http://t1.qpic.cn/mblogpic/55a4bed109f959ca2d62/460\" style=\"border-width: 0px; max-width: 100%;\" /></var></font></a></div>\r\n	<div align=\"left\" style=\"padding: 0px; text-indent: 2em;\">\r\n		<br />\r\n		<var id=\"yiv2012238323yui-ie-cursor\"><a href=\"http://user.qzone.qq.com/1328205471/qzonesoso?isfromic=1&amp;businesstype=7&amp;finger=-1&amp;entry=23&amp;search=%E5%91%A8%E7%AB%8B%E6%B3%A2\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none;\" target=\"_blank\"><font color=\"#0000ff\" size=\"4\" style=\"line-height: 32px;\"><b>周立波</b></font></a><font color=\"#000000\" size=\"4\" style=\"line-height: 32px;\"><b>：不查都是天灾，一查全是人祸；<br />\r\n		不查处处鲜花，一查全是豆腐渣；<br />\r\n		不查都是中国人，一查全是外国籍；<br />\r\n		不查都是孔繁森，一查全是王宝森；<br />\r\n		不查个个人模人样，一查全都男盗女娼；<br />\r\n		不查问题都在后三排，一查根子在主席台；<br />\r\n		不查都为人民服务，一查全被人民服务；<br />\r\n		不查个个身体棒，一查全靠伟哥帮忙。</b></font></var><br />\r\n		&nbsp;</div>\r\n	<div align=\"center\" style=\"padding: 0px; text-indent: 2em;\">\r\n		<var id=\"yiv2012238323yui-ie-cursor\"><a href=\"http://t1.qpic.cn/mblogpic/5bb270dc660464af75bc/460\" rel=\"nofollow\" style=\"color: rgb(123, 87, 23); text-decoration: none; outline-style: none;\" target=\"_blank\"><img src=\"http://t1.qpic.cn/mblogpic/5bb270dc660464af75bc/460\" style=\"border-width: 0px; max-width: 100%;\" /></a></var></div>\r\n</div>\r\n<p>\r\n	<br />\r\n	&nbsp;</p>\r\n',NULL,'2012-10-31 07:34:39','周立波说这样的话，是汉奸，或是事实？',1),(18,'<p>\r\n	井底望天:钓鱼岛和战争</p>\r\n<p>\r\n	大家在网上一片喊打喊杀的，所以我等了这么长时间，等到大家血液的温度都降下来了，才想谈一下钓鱼岛和战争的问题。</p>\r\n<p>\r\n	我自己是比较反对战争的。</p>\r\n<p>\r\n	正如孙子同学说过，战争，啥啥国之大计，啥啥死生之地，等等，总而言之，要慎重。</p>\r\n<p>\r\n	但是不愿意战争，并不等于就不备战。中国不应该挑起战争，不过人家要想玩一把，那么中国就必须有以战止战的决心。</p>\r\n<p>\r\n	先看一下在钓鱼岛上面，目前的形势发展的轨迹。</p>\r\n<p>\r\n	在中日关系正常化的时候，中日双方的领导人考虑到两国关系的大局，决定共识是搁置在钓鱼岛上面的领土争议，希望将来可以做到共同开发。</p>\r\n<p>\r\n	但是这个共识，或者说默契，被日本单方面打破了。</p>\r\n<p>\r\n	这个就是<span xml:lang=\"EN-US\">2</span>年前，中国的福建詹船长，在钓鱼岛海域被日本政府非法拘禁超过<span xml:lang=\"EN-US\">2</span>个星期的事件。</p>\r\n<p>\r\n	因为按照以前的共识，如果日本政府截停了中国渔民，通常是通知中方，然后马上放人。</p>\r\n<p>\r\n	但是这个时候，日本管事的黄毛小子，名字叫做前原诚司，就乘机用这个事件破坏中日双方的共识，开启了钓鱼岛争端和中日开始逐渐走向对抗的局面。</p>\r\n<p>\r\n	这个局面，其实就是在美国要重返亚太的大背景下发生的。</p>\r\n<p>\r\n	在美国要返回亚太的当儿，就是日本的鸠山同学当首相的时候。</p>\r\n<p>\r\n	鸠山同学上位的时候，火力够猛。他除了在希拉里阿姨到日本访问，要求和他见面的时候给阿姨吃闭门羹，还在美国的纽约时报上发儌文，声讨美国的政经模式和外交政策，并且宣布亚盟的建立指日可待。</p>\r\n<p>\r\n	然后很快韩国的天安舰事件，导致日本安全议题变成国民的主要考量。在这种变化的民意之下，鸠山同学将美军基地普天间搬出琉球的立场不得不放弃，在日本亲美派的反攻下，只好下野了。</p>\r\n<p>\r\n	这之后，就是变成了日本外相的前原和希拉里阿姨的二重唱，将美日安保条约运用到钓鱼岛上。然后在中国对日本实施了一系列的经济教训之后，算是把局势稳定下来。</p>\r\n<p>\r\n	不过这个平稳局面，又被日本的最后一代爱国愤青石原慎太郎的炒作之下，变得再以不可收拾。</p>\r\n<p>\r\n	那么日本的这一系列操作，主要的战略目标在哪里？</p>\r\n<p>\r\n	首先外界对钓鱼岛的基本消息并不准确。因为钓鱼岛本身的资源并不重要，日本人想占住这个岛，其实是两个目的。</p>\r\n<p>\r\n	第一个就是日本希望靠钓鱼岛在东海大陆架的位置，以中线等距离和中国公海划界，来分东海海底油气资源的一杯羹。</p>\r\n<p>\r\n	其实对日本想来分资源，我一直的想法，就是要想换资源可以，拿日本的高科技，特别是节能方面的高科技，来和中国换。</p>\r\n<p>\r\n	因为如果中国的耗能效率上去了，总体的能耗量就不会那么高，这样的话，全球的炒家们就没有那么得瑟，那么其他的用能源的，比如说日本、韩国、印度等等，和中国一样，日子都会好过一点。</p>\r\n<p>\r\n	这个就是所谓合则两利，斗则两伤的道理。</p>\r\n<p>\r\n	但是日本人好像不懂这个简单的道理。这个是因为日本人占住钓鱼岛的意思，还有另外一个不想告人的隐忧。</p>\r\n<p>\r\n	那就是日本现在占住的所谓冲绳，原名琉球的地方，是以非常不正当的手段拿下来的。</p>\r\n<p>\r\n	因为按照第二次世界大战结束之后，盟国接受日本投降的条件，就是日本领土只限制在北约<span xml:lang=\"EN-US\">30</span>度以上的日本本土四个岛屿。</p>\r\n<p>\r\n	至于其他的岛屿（比如说琉球）的主权归属，由战胜国商议决定。</p>\r\n<p>\r\n	而因为当时中国内战的原因，后来联合国委托美国托管琉球，然后在<span xml:lang=\"EN-US\">1972</span>年的时候，美国因为希望日本在经济上的让步，将琉球的治权交给了日本。</p>\r\n<p>\r\n	而日本最怕的就是，如果将钓鱼岛还给中国，会导致琉球的不保。</p>\r\n<p>\r\n	那么我可以负责任地说一句，正是日本人自己在钓鱼岛上的背信弃义，这样的局面将来一定会出现。</p>\r\n<p>\r\n	其实我早就说过，中国和日本不存在东海划界的问题。因为在北纬<span xml:lang=\"EN-US\">30</span>度以下，中国只有和未来的独立的琉球王国划界的可能。日本，是没资格来谈其他国家的领土问题的。</p>\r\n<p>\r\n	今天的琉球人民恐怕还不明白，如果选择了独立，就算是按照琉球海沟来划界，也可能让琉球国成为东亚的科威特，可以说是富得流油。</p>\r\n<p>\r\n	但是要说琉球继续变成美国用来遏制中国的前沿阵地，那么不论中美之间的战争结局如何，琉球恐怕是不会由任何一块土地会存活下来。</p>\r\n<p>\r\n	也许将来要有人拍部未来的战争片那样的东东，然后传到琉球让大家看一看。</p>\r\n<p>\r\n	那么美国在亚太的重新军力部署，其实有点象当年诸葛孔明的添灶撤军的法子。</p>\r\n<p>\r\n	因为美国未来的亚太防御重点，已经要从强手林立的东北亚，向防守比较薄弱的东南亚转移。</p>\r\n<p>\r\n	这个包括在澳洲北部的达尔文港口，开设海军和陆战队基地，然后在菲律宾、新加坡和越南寻找长期的军事合作，以抗衡中国在南海的不断坐大。</p>\r\n<p>\r\n	那么这个时候，日本在东海的动作，就有一方面牵制住美军军力留在东北亚，另一方面以中国军力威胁为借口，开始增强军备。</p>\r\n<p>\r\n	而这个增强军备，也必须以不引发美国的猜忌为底线。</p>\r\n<p>\r\n	那么日本这样的不断加深对抗的方法，会不会引发冲突？</p>\r\n<p>\r\n	目前来看，中日双方的对抗，基本上是中国城管对日本城管，大家还没有到动用军队的地步。不过美国倒是早早的将航空母舰战斗群布置在海域附近，恐怕也是一种威慑力量，怕有人趁机升级吧。</p>\r\n<p>\r\n	在这个时候，其实作为日本人，做任何冲突计划的时候，必须考虑以美军不介入作为最坏打算。</p>\r\n<p>\r\n	而中国人的冲突计划，就必须考虑美军介入作为最坏打算。</p>\r\n<p>\r\n	这个其实就是当初美国人用来平衡海峡两岸对抗的模糊战略。</p>\r\n<p>\r\n	不过对日本人来讲，这个从来都靠偷袭来抢夺战略优势的民族，从<span xml:lang=\"EN-US\">1904</span>年偷袭旅顺港和沈阳的俄罗斯军队，到后来的<span xml:lang=\"EN-US\">918</span>事变和<span xml:lang=\"EN-US\">77</span>事变，到后来的偷袭珍珠港，似乎觉得和中国的冲突，可以限制在一个局部战争的钓鱼岛攻防战上。</p>\r\n<p>\r\n	而且日本人还觉得，与中国军力对比，其空军虽然不占优势，但是海军还不错，似乎还有一战可打。</p>\r\n<p>\r\n	但是日本人难道不想想，一旦战争开启，那么日本本土的任何一个地方，包括大都市东京，包括日本全境的核电站，都是中国导弹的合法目标？</p>\r\n<p>\r\n	甚至战争打到上原子弹的地步，也不足为奇？</p>\r\n<p>\r\n	因为很简单，以中国人民间的仇日心态，以中国目前的国家实力，一旦中日开启战端，对日本来说，只有一个结果。</p>\r\n<p>\r\n	因为很简单，日本想推翻第二次世界大战的结果和国际格局，就比如希特勒要推翻第一次世界大战的结果和国际格局，是作为战胜国的中国不能允许的。</p>\r\n<p>\r\n	以前的中国国力不够，没法出来行使自己应该承担的维护国际次序的责任。但是现在中国已经不同，必须到要站出来的时候。而且随着时间，中国站出来维系国际次序的能力会越来越大。</p>\r\n<p>\r\n	美国的重返亚太，已经引发了亚太地区的战云密布。那么对中国来说，还是要拿出打持久战的耐心。继续加大力度发展自己的军力，不怕和美国展开军备竞赛，因为美国的亚太战略，是需要巨额资金来支撑的。</p>\r\n<p>\r\n	在这个同时，中国就需要学习欧洲那样把英国甩出局，在东亚的经济整合中，也可以把日本甩出局。毕竟对了解地缘政治的人来说，所谓拉着日本搞啥亚盟，幻想啥亚元的东东，都是做梦。</p>\r\n<p>\r\n	因为日本人对中国的敌意，不是舆论上宣传的那样一小撮右翼啥的，而是普遍的对日本衰落，对中国走回世界顶峰的前景不接受。</p>\r\n<p>\r\n	不论如何，对人家选择灭亡的意愿还是要尊重。毕竟选择在南京大屠杀的是日本人自己，选择在广岛和长崎吃大蘑菇的也是日本人自己。</p>\r\n<p>\r\n	我们大家不必太过在意。</p>\r\n',NULL,'2012-10-31 07:44:11','井底望天:钓鱼岛和战争',1),(19,'<p>\r\n	【环球网综合报道】&ldquo;楼顶摄影&rdquo;（Rooftopping）是一种足以令人心跳停止的摄影方式，寻求刺激的摄影师必须爬到摩天楼的楼顶，而后冒险来到楼顶边缘，最后用镜头记录脚下的壮观景象。现年28岁的汤姆&bull;瑞亚博伊（Tom Ryaboi ） 便是一位非常活跃的楼顶摄影师，曾爬上100多座摩天楼，用镜头捕捉下令人叹为观止的景象。</p>\r\n<p class=\"c1\">\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090319881.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　加拿大多伦多，玩命的楼顶摄影师汤姆&bull;瑞亚博伊（Tom Ryaboi ）站在连接摩天大楼的两根电缆上。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090319158.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　摩天大楼顶层的气温有时会达到零下，并且风也较大。加拿大伦多，一个戴着面具的男子站在一座高楼的窗户清洁吊架上。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090320237.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　汤姆&bull;瑞亚博伊说，坐在摩天楼顶部，他有种回家般安心的感觉，就如鱼儿在水中一样自在。他和他的团队至今已经攀登了100多座高楼。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090321320.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　汤姆&bull;瑞亚博伊说，当许多其他小孩选择坐在家里玩iPad或打游戏时，他和其他朋友则选择另一种成长方式。他们探索周围的世界、地下管道、废弃的楼房等等，当然，还包括摩天大楼的楼顶。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090322819.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位顶楼摄影师，手拿面具，俯瞰多伦多全景。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090323335.jpg\" /><br />\r\n	<br />\r\n	　　汤姆&bull;瑞亚博伊称，全球各地有许多楼顶摄影师。他们唯一的目的是站在一个别人没站过的角度，去看最独特最真实的城市风貌。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090325820.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　汤姆&bull;瑞亚博伊从一座摩天大楼楼顶俯瞰。背后是加拿大国家电视塔。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090326794.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　多伦多，一座摩天大楼在弥漫的雾中隐现。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090327970.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一张令人晕眩的多伦多街道。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090329342.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位男子站在屋顶俯瞰多伦多。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090330575.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位楼顶摄影师站在高层建筑的边缘，向下俯瞰。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090331939.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位女子坐在摩天大楼屋顶上俯瞰多伦多。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090333896.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　多伦多，汤姆&bull;瑞亚博伊从摩天楼顶部俯拍的景象。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090333348.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　加拿大国家电视塔耸立在多伦多空中的薄雾里。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090333348.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　加拿大国家电视塔耸立在多伦多空中的薄雾里。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090336124.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位戴着面具的楼顶摄影师在顶楼边缘行走着。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090336205.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　多伦多夜景。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090337437.jpg\" /><br />\r\n	<br />\r\n	　　汤姆&bull;瑞亚博伊拍摄的一张摩天楼和街道的照片。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090339988.jpg\" style=\"width: 649px; height: 432.66px;\" /><br />\r\n	<br />\r\n	　　从多伦多一座摩天大楼上，向下俯瞰拍摄到的街道。<br />\r\n	<br />\r\n	<img border=\"0\" src=\"http://himg2.huanqiu.com/attachment2010/2012/1101/20121101090340793.jpg\" style=\"width: 649px; height: 405.43px;\" /><br />\r\n	<br />\r\n	　　一位摄影师在多伦多一座摩天大楼的平台上架好相机，准备拍摄。</p>\r\n',NULL,'2012-11-01 08:54:15','恐高者勿入！令人惊心动魄的楼顶摄影(高清组图)',1),(20,'<p>\r\n	原本是想躲懶的。只是因為前一两天有朋友問到這個事情，於是索性找個時間寫寫自己的思路。值得說明的是，本文的唯一價值就是拿來扯談，國際政治與各國的政治咦鞑皇俏业刃∶窨梢阅X補說&ldquo;掌握&rdquo;的。但是，口水政治卻是網友們的老傳統啦，也算是無聊網絡生活裏自娛娛人的一個不錯的遊戲。千萬不要認為事實就是這樣哦，每個口水政治戲劇的開始都會說的臺詞是：如有雷同，不勝榮幸。</p>\r\n<p>\r\n	首先，個人認為&ldquo;釣魚島爭端&rdquo;之爆發是日本有意策劃，精細組織與充滿了戰術意識的典型的日本式戰略。我們可以注意到，釣魚島爭端的發展與升級是一直為日本所主導或者主動的。這個特點是非常明顯而需要被強調的。</p>\r\n<p>\r\n	一、</p>\r\n<p>\r\n	我們知道如下事實是不言而喻的：</p>\r\n<p>\r\n	1.雖然北京一直主張釣魚島的主權屬於中國，但是過去的幾十年，釣魚島的實際控制一直為日本所掌握。</p>\r\n<p>\r\n	2.在過去的20年，雖然兩岸或者華人世界的保釣浪潮一波又一波，但是北京政府對於日本實際控制釣魚島的事實，或者對於民間保釣的支持，都是較為策略性的克制。</p>\r\n<p>\r\n	3.北京在鄧小平時代，事實上就釣魚島問題做過政治性的原則概括&mdash;&mdash;&ldquo;後代比我們有智慧，一定可以解決這個問題&rdquo;。本質上北京推行的是一個綏靖政策，對於釣魚島並未積極主張行動。</p>\r\n<p>\r\n	4.在鄧小平時代以及以後，北京和日本其實是就釣魚島問題有默契的。雙方在釣魚島問題上都達成了一些彼此克制的部分。總的來說是，北京不智蠓e極改變釣魚島為日本實際控制的現狀，日本不拒絕中國漁民在釣魚島海域的活動。</p>\r\n<p>\r\n	5.北京一直在釣魚島問題上保持了克制，這個部分就釣魚島危機爆發之前來看，沒有證據顯示北京有積極改變這個綏靖政策的意圖或者動作。我們不難發現，事實上北京沒有積極的試圖在未來或者某個明確時點改變釣魚島被日本所控制的現實，更何況是徹底解決釣魚島問題了。</p>\r\n<p>\r\n	二、</p>\r\n<p>\r\n	以下事實也不應該被忘記：</p>\r\n<p>\r\n	1.中國漁民在釣魚島捕魚遠不是第一天了。之前的日本最多只是驅逐而非逮捕，或者試圖審判。在釣魚島危機發展到今天之前，日本已經在對待中國漁民問題上，采取了破環默契與&ldquo;改變現狀&rdquo;的舉動&mdash;&mdash;日本非法逮捕了中國船長，並且試圖審判。這在當時是一個重大外交爭議。</p>\r\n<p>\r\n	2.如果說，船長問題還可以用民主黨政府不熟悉慣例或者在外交上生疏作為一個解釋的話。那麼，後面日本迅速升級釣魚島危機就非常的值得玩味了。購島鬧劇首先是東京都的石原在鼓吹的，並且號召的是民間捐款。當時就已經引發了北京方面強烈的反對信號。此後，日本東京有聲音表示，不能讓石原購島，應該是東京來國有化這個島。值得提醒的是，胡鍧跂|盟會議上，直接對當時的日本首相野田表示，購島之舉萬不可行。日本首相是非常清楚北京的外交底線與態度的。如果日本東京有意在某個程度上避免重大地緣危機，這個時候完全可以采取緩一緩的態度。但是，事實上，與胡碰面後回國的第二天，日本政府悍然宣布國有化釣魚島。這是對於胡的重大羞辱。</p>\r\n<p>\r\n	3.釣魚島問題自漁民船長被抓開始，我們知道兩岸都發生了很多民間自發的保釣邉印＿@個保釣邉酉喈旈L時間裏是以香港為活動中心。香港保釣人士數次試圖去釣魚島抗議，並且策劃登島。在釣魚島被所謂國有化後，大陸的群眾性保釣邉痈踊鸨ｋm然我們清楚其中大多數是基於樸素的愛國熱情。但是，自船長被抓開始，很多保釣邉颖翅岬馁Y金來源與組成人員帶有非常奇異的&ldquo;日本血統&rdquo;。也就是說，保釣組織的活動有日本資金的支持，一些參與保釣的人，同時也是積極參與所謂&ldquo;民主邉�&rdquo;的人馬。</p>\r\n<p>\r\n	4.我們注意到，釣魚島危機的爆發始終是在日本主動誘導與升級下逐步尖銳化的。</p>\r\n<p>\r\n	三、</p>\r\n<p>\r\n	我們同時還注意到下面一些雙邊關系的背景：</p>\r\n<p>\r\n	1，中日之間的貿易與經濟關系在過去20年是非常緊密的。大陸不但是日本重要的產業布局的一環，同時也日益是日本重要的海外市場。大陸在相當時間裏，也得益於與日本的這種經濟關系&mdash;&mdash;日本的資金，技術與管理經驗依然是大陸長期以來學習與需要的對象。兩大經濟體的聯系已經是剪不斷，理還亂。事實上，盡管兩國間關系隨著時勢的變遷而時有緊張，但是都未特別的影響到雙方的經濟關系，雙方在經濟上還是互相保持了克制。&ldquo;政冷經熱&rdquo;是很常見的描述。</p>\r\n<p>\r\n	2.中日關系是存在過相當友好的一個黃金時期的，並且兩國政治家基於長遠的考慮，都在過去相當時間裏積極推行兩國民間與政府間的友好。我們不應該忘記整個八十年代到九十年代以來，日本整體對華友好與民間交往的活躍這一事實（包括經濟上的援助）。日本在相當時間裏，也是試圖構建一個基於長久利益與和平的兩國關系。</p>\r\n<p>\r\n	3.北京一直試圖整合東北亞，希望形成東北亞一體化的經濟自由貿易體。這個戰略也是北京非常努力推行的，並且一直與韓國，日本，俄國，甚至包括朝鮮在積極的溝通。北京在對日本的問題上，並沒有采取曆史本位主義的情緒性政策。應該來說在相當的時間裏，北京同樣是期待建立中日間比較和諧與面向未來的關系。</p>\r\n<p>\r\n	4.08年經濟危機後，日本經濟陷入了困境。在福岛大地震後，日本經濟出現了連續的負增長，並且外貿出現了多年來的逆差。日本經濟陷入結構性衰退的陷阱已經20年了。但是同期中國的發展被認為是人類曆史上最快，最大規模的工業化與城市化邉印�</p>\r\n<p>\r\n	一言以蔽之：在中日經濟如此緊密聯系的時候，在日本經濟困難，需要中國大陸市場的時候，在北京沒有重大戰略變革威脅日本安全的時候，在北京當面明確表達希望日本克制的時候，日本不管不顧的強硬升級了釣魚島爭端，全然不顧及日本在華的經濟利益與長期積累的政治資源，直接挑釁北京在釣魚島問題上的底線與十餘年來的雙邊默契，迫使北京直接強硬的采取行動來改變日本對於釣魚島的實際控制&mdash;&mdash;這完全違反了&ldquo;當家不鬧事&rdquo;的邏輯。這種奇異的決策與邏輯，到底是為什麼？這需要我們去猜測與解答。</p>\r\n<p>\r\n	四、</p>\r\n<p>\r\n	日本在想什麼？它到底要什麼？</p>\r\n<p>\r\n	要回答上面的問題，答案其實說穿了很簡單。不過整個支撐這個答案背後的邏輯卻很複雜。這恰恰是政治，或者國家博弈最為令人著迷的地方。</p>\r\n<p>\r\n	日本為什麼要在釣魚島問題上采取這麼激烈的方式，顯然必須放在日本國家利益與長遠角度去思考才合乎情理。</p>\r\n<p>\r\n	一般來說，在國內挑動極端的民族主義情緒，並且試圖用外部危機來鞏固政權或者贏得選舉，這是現代國家，或者采取代議制民主選舉制度的國家經常有的一個行為邏輯與政治心理。釣魚島問題不能排除這種可能性。但是，如果單純是這樣，為什麼是釣魚島？為什麼這麼激烈？為什麼是這個時間？簡單化將局勢解釋為日本政客的自私與愚蠢，完全沒有考慮到北京反制的激烈與對於日本經濟，地緣安全的重大傷害，這顯然是太過於小看日本了。我完全不相信日本單純的只是基於國內政治的短期需要而這樣做。</p>\r\n<p>\r\n	如果選舉需求只是一個附帶的短期利益的話，釣魚島爭端對於日本有長遠的利益與重大的戰略企圖需要被利用嗎？我認為是有的，並且是日本刻意試圖營造與在將來逐步推行的。釣魚島只是這其中的一環，並且是會長期存在的一個地緣政治潰瘍。日本會不斷在釣魚島問題上保持強硬與制造問題。</p>\r\n<p>\r\n	日本是在利用釣魚島來釣魚的！即使釣魚島問題階段性的平靜或者幹脆沒有發生，我相信在本文的邏輯下，中日遲早在其他方面同樣會出現被刻意鼓勵的&rdquo;沖突&rdquo;，並且同樣會持續。</p>\r\n<p>\r\n	這個問題要說清楚，千頭萬緒。但是簡單的削繁就簡的話，可以大概做下面幾個方面的論述：</p>\r\n<p>\r\n	1.釣魚島問題的爆發與發展，以及日本戰略邏輯的展開，是充滿了日本式的民族風格與文化的。換言之，面對同樣的情況，其他民族非常可能不選擇日本這樣的反應。但是日本的文化心理與民族性，使得日本易於做出這樣的戰略冒險。我必須說明下，日本的政治界或者日本的國家曆史，特別是近代曆史，完全是一個賭博的曆史。日本是非常有賭性的民族，賭國呤侨毡踞绕馂楝F代強國很重要的一個傳統思維，也是日本戰略思維上非常突出的特點。日本戰略思維有極端化的偏好。日本的島國特點與不友善的自然環境與資源，使得日本這個民族有強烈的危機意識與求變突圍的心理慣性。日本戰略界的潛意識是善於冒險也敢於冒險的。過去，日本的甲午戰爭，日俄戰爭都是日本在看上去劣勢或者絕對不能輸的情況下，全力壓上而贏得了日本國家現代化的基礎。這是日本無法忘卻的國家底色。</p>\r\n<p>\r\n	2.日本近代以來的主要勝利基本都是針對中國的勝利（或者以事實上犧牲中國利益作為對價）。即使在二戰中戰敗，日本在大陸戰場上的失敗也更多體現在政治而非軍事上。日本在對華作戰的正面戰場上，一直到1944年還保持著戰役進攻的一定自由度。日本戰後的經濟起飛形成的對於大陸在產業鏈上的高端與壓制，也給予了日本比較從容面對大陸的心理。也就是說，日本對華友好或者日本內心的自我國家定位上（包括對於中國的定位），日本是居於心理優勢的上端的。日本內心對於中國的優越感是很強的。這是一個不能忽視的心理因素。</p>\r\n<p>\r\n	3.自2010年，中國大陸的GDP超過日本而成為世界第二。這是一個對於日本社會與民眾心理形成強烈震動的標志性事件。由這個事件引發的日本國民整體性的右傾與心理失衡（這個心理轉換帶出來的中產階級的保守性與民粹性是很有意思的話題，將來有時間可以專門來談談），非常典型的影響了日本的政治。在這個事件之前，日本經濟的長期低迷與沒有方向，已經使得整個日本充滿了挫折感與危機感，大陸的經濟規模超過日本是對於日本民族心理潛意識的重大刺激。</p>\r\n<p>\r\n	4.大陸經濟的發展，不但是規模的擴大，同樣是經濟質量的迅速提升。大陸整體不斷的在產業鏈上攀升。從低端到高端，大陸相對日本是一個有著全面工業體系的國家，同時也是一個擁有巨大國內市場的新興經濟體。大陸還處於高速城市化的發展過程中，大陸經濟中高速發展所帶來的效益，使得大陸在未來的經濟發展完全不是日本可以去比擬的。更可怕的是，大陸每一個產業發展攀升，都是以日本在世界範圍裏喪失其產業比較優勢作為對價的。大陸產業鏈每攀升一點，都使得日本在全球產業分工裏的可替代性被加強一點。白色家電的日系品牌在大陸的全面潰敗就是一個典型的例子，中低端被大陸本土同業打敗，高端被韓國品牌擠壓&mdash;&mdash;日本人必須嚴肅的思考下面一個問題：在大陸不斷的成長的擠壓下，國內市場飽和而高度依賴國際貿易的日本經濟未來的前途在哪裏？日本面對一個具備全工業體系，具備經濟自循環潛力，並且日益邁向高端的中國，日本將來怎麼生活下去？日本整體上在經濟與產業角度的焦慮感是很強的。總得來說，日本在中國市場上的終端消費品與品牌的大潰敗，使得日本在經濟上對於大陸的布局損失了很大一個未來的想象空間。大陸如果只是做日本制造的中間環節，日本獲得的東西還是缺乏成長性的。而美國依然是最大的全球市場，日本很多的在華貿易最終都是轉出口美國或者日本本土。既然如此，隨著中國國內經濟環境與結構的變動，日本產業鏈的全球布局可能會轉向重視東南亞，南亞或者布局美國都是可能的。</p>\r\n<p>\r\n	5.過去10年，大陸軍事實力的高速成長應該說是非常耀眼的一個現象。這表明中國大陸的工業實力與研發水平，整體進入了井噴期。大陸研發了殲10，殲10B，殲11，開始替換龐大的二代機機群。同時，大陸研發了殲20，成為世界上第三個具備研制與裝備第四代戰鬥機的國家。同時，中國�20的首飛，航母平臺的入列，都表明中國戰略空軍與遠洋海軍慢慢成型。未來10年到20年，大陸將擁有遠東最大的，最先進的三代機，四代機機群，並且擁有兩到三個航母戰鬥群。這將在極大程度上，永遠的改變亞洲的力量對比，迫使美國在第一島鏈後退，並且決定性的使得中日力量對比失衡。</p>\r\n<p>\r\n	6.我們可以注意到，目前大陸無論是產業地位上，還是國家實力上，都還處於一個&ldquo;方生方死&rdquo;的過渡期&mdash;&mdash;日本依然是占有產業鏈的上遊，而中國的軍事力量還未完全成型。而大陸在國內經濟與政治，國際安全與地緣，開始比較集中的在這一段大國崛起的摩擦期體現出種種矛盾與現象。時間對於日本來說，並不是朋友。但是現實對於日本來說，卻存在一個可以被哂玫目臻g。</p>\r\n<p>\r\n	五、</p>\r\n<p>\r\n	要說明這個博弈空間我們就必要引入一個太平洋彼岸的強大國家&mdash;&mdash;美國。只有在中美日大三角角度下，我們才能比較清楚的看到釣魚島問題在其中發揮的杠杆和釣魚的作用。</p>\r\n<p>\r\n	美國的亞太戰略，簡單來說就是吃一個，夾一個，圍一個，看一個。吃一個就是吃日本，夾一個就是夾住東南亞，圍一個就是圍堵中國，看一個就是看住俄羅斯。</p>\r\n<p>\r\n	美國在中東與阿富汗發泄了十年精力後，開始將戰略重心返回亞太。這也是基於中國大陸崛起的速度與強度超出了美國的戰略預期。美國開始了&ldquo;重返亞太&rdquo;的再平衡戰略。</p>\r\n<p>\r\n	美國強勢重返亞太，勢必加劇中美間地緣政治與安全領域的摩擦，同時也必然在經濟角度構成一定程度上的摩擦。在世界經濟危機背景下，中美間的戰略再平衡顯然深刻影響了中美經濟大循環的發展，中美矛盾在一定時期內將越來越被人們議論&mdash;&mdash;中國開始不借錢給美國了，要構建國內市場；美國要重新工業化，制造業回歸美國，推行排斥中國的TPP。這自然不會不被日本戰略界所注意到。</p>\r\n<p>\r\n	於是，存在這麼一種邏輯與時間窗口：如果在將來大陸的經濟發展中，找不到日本在全球經濟大循環下的角色定位，那麼日本可以期待在中國這裏獲得什麼呢？如果美國的亞洲戰略與中美戰略再平衡是未來一段時間裏，中美地緣政治的主要議題，日本可以在其中采取什麼戰略來獲得日本國家利益的最大化呢？</p>\r\n<p>\r\n	於是，日本人發現在某種情況下，釣魚島真的是可以來釣魚的！小小釣魚島，一下子調動了兩大強權。</p>\r\n<p>\r\n	讓我們來代替日本戰略家做一個心理分析吧：中國的發展對於日本來說，日益成為一個威脅而不是機會。因為日本是一個以制造業立國而高度依賴國際貿易大循環的外向型經濟體。中國也是一個以制造業立國，深刻參與全球自由貿易的巨大行為者。中日在全球貿易中的角色長期來看是沖突性的，而非互補性的。但是，以美國為代表的金融資本主義國家，對於日本這樣的經濟體來說，廣場協議後更多是作為市場存在而不是作為對手存在。事實上，日元本身都是美元一個強有力的支撐貨幣，東京也是美國全球兩大海外結算中心之一。日本經濟的頹勢，需要海外市場，特別是美國市場對於日本產品的擁抱，也需要美國對於日本在金融與貨幣政策上的強有力支撐。</p>\r\n<p>\r\n	日本的未來在於多大程度上可以保持其對於中國，韓國等國在產業鏈高度上的優勢。而維持這個優勢盡可能久就必須最大限度的增加大陸在現代化上的困難，並且更深刻的贏得與美國關系的實質性改變。</p>\r\n<p>\r\n	所以，自日本經濟陷入結構性陷阱以來，隨著中國經濟的迅速提升，中日關系反而越來越壞，日本越來越右傾。這個戰略預判是早以有之的：敏銳的人在十來年前就會很清楚的看到這一點（所以，個人當年看見大陸有人提對日新思維的時候，真是啞然失笑）。事實上我個人判斷，隨著大陸經濟的持續發展，大陸未來十年將在外交與地緣上陷入更加&ldquo;緊張&rdquo;的摩擦期（特別是周邊國家）。任何樂觀預期未來十年中國外交形式會因為經濟與實力的增長而越來越好的想法，目前都是不合時宜的。</p>\r\n<p>\r\n	現在，隨著美國的亞太戰略的調整，菲律賓在黃岩島首先挑起了爭議。美國在一定程度上，是樂見出現這樣的爭議來為美國亞洲戰略提供落地的政治理由的。</p>\r\n<p>\r\n	日本覺得，是需要在這個問題上做出勇敢而痛苦的冒險了。於是，雖然上述所有的背景與原因都不足以與釣魚島構成直接的因果線性關系，但是綜合起來卻在釣魚島上觸發了一個足夠有曆史標志性事件的危機！</p>\r\n<p>\r\n	另外，好死不死，日本又發生了福島大地震。這個地震強烈的加速了日本國內政治與經濟的困難，打破了日本心理與戰略上的安定。正如當年關東大地震使得日本右傾冒險主義達到高潮，從而誘發了全面侵華戰爭與後續的一聯系軍事冒險一樣，這次大地理又把日本帶到了曆史慣性的岔路口上。日本試圖利用釣魚島，以及釣魚島危機所代表的意涵，來下一個走鋼絲般的戰略手筋，試圖為日本這個殘局做活。我們應該承認，日本的戰略企圖是非常具備想象力與壯士斷腕般的勇氣的。</p>\r\n<p>\r\n	六、</p>\r\n<p>\r\n	在中國因為換屆時期，比較重視內部整合的時候，日本試圖利用這個戰術有利時期，以極大程度的犧牲與北京的雙邊關系以及在大陸重大的經濟利益為代價，達到下面幾個目的：</p>\r\n<p>\r\n	1.在較好的判研北京無意在關鍵的戰略機遇期裏面對一場重大的邊界戰爭的前提下，在美國加強在亞洲軍事存在而北京尚未建立起全面的海空一體戰能力的背景下，日本持續的，積極的，可控的制造與北京的沖突與矛盾，服務於美國的亞洲戰略，從而獲得美日同盟的強化。這在將來中國大陸軍事力量必然增長的預期下，這可以有效加強日本的國家安全與增加對於既有地緣戰略談判上日本的籌碼。</p>\r\n<p>\r\n	2.日本長期以來有一個戰略憂慮。就是當大陸持續發展，美國從第一島鏈後退，日本的戰略地位與角色怎麼安排。日本較為孤獨的面對中國大陸的戰略壓力，日本還能夠多大程度上的保有現在的地緣利益與國家安定（一個簡單的例子就是怎麼在未來還可以占據釣魚島）？目前情況下，在自己占據戰術優勢的地方與大陸進行持續沖突，可以&ldquo;養匪自重&rdquo;，使得日本在美國亞洲戰略中的作用更加凸顯與吃重。日本與北京的熱點沖突，將使得美國必須基於其國家信用與戰略利益加強其與日本的雙邊關系，對於日本進行更多實質上的支持。進而將美國拖入日本設置的戰略軌道，將美國捆綁在日本的國家利益需要的方向上。</p>\r\n<p>\r\n	3.與大陸的持續沖突，日本希望獲得一個較為有利的與美國談判的情境，從而獲得一些正常情況下不太容易獲得的戰略與經濟利益。這種利益包含下面三個方面：其一，軍事政治上的支持，其中包括加強對於日本自衛隊的武裝，默許日本修改其國內法，松綁其對與日本正常國家化構成障礙的法律與政治環境；其二，金融與貨幣政策上的支持。日本期望美國可以在金融與貨幣政策上，支持日本的要求。基於&ldquo;共同抗中&rdquo;的原因，允許日元與美元的匯率變動，日元兌美元貶值，加強日本經濟的競爭力。日本也期望美國在剪羊毛服務其國內經濟的時候，對於日本下手要輕一些。畢竟是&ldquo;共同抗中&rdquo;時期嘛。皇帝不差餓兵。其三，日本希望美國加大進口日本產品，並且更大限度的放松對於日本的市場控制，扭轉美國因為重新工業化對於&ldquo;日本制造&rdquo;在美國市場上面對的不友善環境。同時，有可能的話，加強對於中國產品的市場壁壘。</p>\r\n<p>\r\n	4.日本與大陸的沖突長期化，在地緣節點上的摩擦持久化，將會不斷強化美國在亞洲日本方向上的戰略投入。如果隨著中國大陸實力的強化，其對於日本壓力的逐步加大，長期來看日本期望這種壓力將傳遞到美國身上，從而使得美國在成本與效率之間，選擇放松對於日本的控制，重新考慮加強日本自身的能力來分擔來自中國的戰略壓力。也就是說，日本期望利用與中國的有限沖突來實現與美國雙邊關系的某種&ldquo;平等化&rdquo;，從而誘導美國實質上的允許日本正常國家化。</p>\r\n<p>\r\n	5.同時，日本也希望借由這種沖突，誘導中國大陸扭轉其國家戰略的偏向，增加中國大陸現代化道路上的不確定性。如果這種沖突能夠誘導起大陸的國內極端民族主義情緒，進而幹擾到北京的政治穩定與戰略清晰的話，這將嚴重惡化大陸現代化進程的步伐，使得中國在全球外交與地緣政治上的選擇變得困難。日本當然希望可以在某個程度上打斷中國的現代化進程，但是這個概率太小，並且也可能使得日本首當其沖的付出過於高昂的代價。但是，嚴重幹擾到中國大陸的發展，特別是內部社會環境與商業環境的發展，卻是日本樂見的。</p>\r\n<p>\r\n	與一般的解讀相反的是，我認為日本引發釣魚島危機的主要戰略目標不是中國大陸，因為其在中國大陸是得不到任何好處的，只能是付出代價（典型的例子是，北京啟動了迄今為止針對日本在華經濟利益的最大規模清洗。其中比較標志性的是鼓勵中國制造在汽車產業鏈上形成對於在華日本車零件的替代，以及在寶鋼全面的淘汰基於日本技術的生產線），其正收益的來源其實是美國。也就是說，日本的戰略其實看上去是針對中國大陸的，其實本質上是試圖捆綁與誘導美國。</p>\r\n<p>\r\n	日本試圖用釣魚島做魚竿，中國大陸做魚餌，來吊美國這條大鯊魚。日本希望美國與北京是兩只西班牙牛，日本揮舞釣魚島這塊紅布來獲得兩強對撞帶來的紅利。日本付出在中國大陸的重大經濟代價，付出其在釣魚島實質控制能力減弱的代價，希望&ldquo;吊上來&rdquo;的是日本經濟的再啟動，美國與日本關系的再平衡與日本的正常國家化這三條大魚。</p>\r\n<p>\r\n	日本很清楚，他在釣魚島的動作下的是命令手。日本投子後，北京不得不應，美國也不得不應。雙方的反應都是可以預期的。日本也根本不害怕在整體上惡化其與周邊國家的關系，這種惡化雖然是日本的麻煩，但是更是美國的麻煩。日本使得自己在火線上的時候，日本就處於美國亞洲戰略舞臺的中心，成為一個美國當下必須處理的重要的&ldquo;一眼&rdquo;。所以我們看到，日本幾乎同時與韓國和俄國發生了一連串的矛盾。這兩個個國家都是與日本在經濟結構上，交集不多的。不能不說，這是日本非常敢於進行豬突性戰略賭博的民族性格的反應。日本是在走鋼絲的。要點是：第一，不能真正的與中國打起來。第二，不能使得危機看上去不&ldquo;引入注目&rdquo;。日本這棋極大的限制了北京的反應&mdash;&mdash;北京不得不強硬，但是也不希望真失控；美國雖然保持了三方中最大的戰略自由度，但是也不得不&ldquo;下場&rdquo;。</p>\r\n<p>\r\n	日本目前確實付出了看上去很慘烈的代價，但是總得來看還是短期並且可控的。因為中國在很多地方，還是需要日本的東西，日本還有短暫的產業鏈優勢可以哂谩ｋm然日本付出了&ldquo;現在&rdquo;，但是&ldquo;現在&rdquo;對日本不值錢，日本真正需要的是未來！但是日本沒有未來！</p>\r\n<p>\r\n	所以，日本再次冒險，日本再次開始再賭國吡耍&cup;毡驹谫&euro;美國不會拋棄日本，賭中美結構性矛盾不會消失並且會更加激烈！只要這個前提是對的，日本的賭不能說是毫無理性的。</p>\r\n<p>\r\n	我們知道，日本成為現代國家是因為日本賭贏了甲午海戰，並且充分利用了英國當時在亞洲需要平衡其他列強與俄國的地緣戰略需要。我們也知道，日本二戰中再次進行了戰略賭博，輸掉了國家的獨立性。我們更知道，日本戰後的經濟再崛起，一個重要的戰略契機是冷戰的需要與朝鮮戰爭的爆發，這使得美國整體上暫停了對於日本的社會改造，重新定義了日本的戰略地位，進而全面扶持日本。現在就看美國是會怎麼處理了。美國還是主動的一方。日本入戲已深了。</p>\r\n<p>\r\n	日本希望在21世紀的今天，在面對中國大陸越來越大的戰略壓力面前，將釣魚島變成一個&ldquo;新朝鮮戰爭&rdquo;，然後希望北京來扮演蘇聯，美國來扮演交易對手，釣魚島是&ldquo;朝鮮&rdquo;，而日本還是扮演過去的&ldquo;日本&rdquo;&mdash;&mdash;美國在亞洲最重要的地緣戰略支撐點，美國在亞洲的代理人，美國全面支持的日本再崛起與亞洲的領導者。日本賭贏了，就是亞洲的英國。賭輸了，就徹底的悲劇了。</p>\r\n<p>\r\n	因此，釣魚島只是一個序曲，即使釣魚島問題起伏不定，中日之間的戰略與地緣對抗將在未來成為一個常態性的東西。中日地緣戰略的矛盾將會長期化，潰瘍化與持久化。特別的，偶需要再強調下，雖然本文是在講釣魚島，但是在本文邏輯下展開來看，我們必須在未來習慣面對一個，甚至一群充滿角色扮演欲望的，帶有惡意的鄰居。</p>\r\n<p>\r\n	但是我必須說的是，任何戰略賭博都是不得已的無奈之舉，這點對於日本尤其如此。既然日本的期待是自己想做漁翁，那麼北京與華盛頓真的會甘願扮演魚餌與魚嗎？國王只與國王一起散步，交易只存在於平等的雙方之間。</p>\r\n<p>\r\n	釣魚島上釣魚忙，但是誰才是魚呢？這是場好戲！讓我們拭目以待吧。</p>\r\n<p>\r\n	七、</p>\r\n<p>\r\n	在本文思路形成之時，還是釣魚島危機剛剛發生的時候。當時還看不出有什麼實質性的東西發生。最近的幾個新聞可以羅列下，作為一個注腳，也可作為釣魚島事件發生後的戲碼看待。</p>\r\n<p>\r\n	1.日本公開呼籲美元與日元的匯率要變革為100日元比1美元。</p>\r\n<p>\r\n	2.日本政府計劃邁出前所未有的一步，動用納稅人基金直接購買工廠和機器。安倍晉三計劃斥資1萬億日元（71億美元）購買電子、機械設備以及碳纖維工廠，刺激工業加速投資。此前，其誓言振興日本核工業，增加新一代核反應堆。</p>\r\n<p>\r\n	3.日本財務省公布30年期國債拍賣結果：認購額僅為計劃量的29.47%，收益率飆升至1.99%...</p>\r\n<p>\r\n	4.安倍將量化寬松10-110萬億日元，希望利用日元大幅度貶值和制造通脹來刺激出口，重振經濟（說明一下，這是非常有賭博性質的民粹式經濟政策，非常可能帶來全球範圍裏的貨幣及匯率沖突並在通脹上帶來影響。此外，這將帶來日本債務問題的嚴重惡化，日本國民能夠承受的債務極限就是債券實際收益率不能為負值。如果今年日本經濟的增速達不到2%，日本就離債務危機不遠了）。</p>\r\n<p>\r\n	5.美國宣布將在日本部署一個中隊的F22，並且部署魚鷹。</p>\r\n<p>\r\n	6.日本與美國的聯合軍事演戲強化了奪島內容。</p>\r\n<p>\r\n	7.日本現在在推20萬億日元經濟刺激計劃。這是背水一戰。這個經濟刺激計劃相當於他們去年經濟規模的40％ 。</p>\r\n<p>\r\n	8.中國常態化巡航釣魚島，公布領海基線，而日本出動軍機進行攔截。並且警告可能會使用&ldquo;警告性射擊&rdquo;。</p>\r\n<p>\r\n	9.美國釋放出模糊的信號，一方面有安保適應釣魚島的聲音，一方面又警告日本要求克制，不要&ldquo;開火&rdquo;。</p>\r\n<p>\r\n	10.北京進行了一次新的陸基中段反導攔截技術試驗。</p>\r\n<p>\r\n	.........等等........不再羅列了。</p>\r\n<p>\r\n	後面應該還會發生很多新聞，........慢慢看吧。</p>\r\n<p>\r\n	出處: 釣魚島上釣魚忙 - 中國論壇 - udn城市</p>\r\n',NULL,'2013-02-01 02:25:56','转台湾人写的<釣魚島上釣魚忙>',1);
