INSERT INTO `livechannel` VALUES (1,'2012-07-18 15:43:54',-1,'吸引大学生参与',NULL,'images/defaultImgs/onlive.jpg','知元杯网络英语大奖赛',NULL,NULL,NULL,NULL,0,0,6,NULL,NULL,1),(2,'2012-08-01 10:00:01',NULL,'手把手教给你怎么投资',NULL,'upload/onlive/17/2012080109595191753.jpg','股票投资最佳时期和最佳投资方案',NULL,NULL,NULL,17,NULL,NULL,17,NULL,NULL,1),(3,'2012-08-26 05:46:25',NULL,'- 了解自己，了解他人\r\n- 沟通风格类型测试\r\n- 各种风格类型典型特质\r\n- 如何与不同风格类型老板，同事，朋友，客户沟通',NULL,'upload/onlive/2/2012082605461628946.jpg','高效沟通技巧  ',NULL,NULL,NULL,NULL,NULL,NULL,2,3,197,1),(4,'2012-10-06 10:19:12',NULL,'   she ji ji chu zhi shi ',NULL,'upload/onlive/63/2012100610185013753.jpg','  she  ji ',NULL,NULL,NULL,NULL,NULL,NULL,63,3,0,1),(5,'2012-10-08 15:57:27',NULL,' 如何找到适合自己的工作，怎样写自己的简历......',NULL,'upload/onlive/63/2012100815554610135.jpg','职场如战场',NULL,NULL,NULL,NULL,NULL,NULL,63,3,0,1),(6,'2012-10-08 16:02:24',NULL,'  现在的生活压力越来越大，您是否也也会很浮躁......',NULL,'upload/onlive/63/2012100816001649199.jpg','聆听心底的声音',NULL,NULL,NULL,NULL,NULL,NULL,63,3,120,1),(7,'2012-10-08 16:13:03',NULL,'   您知道餐桌上的礼仪吗？您知道怎样跟上级领导打交道吗？您知道......',NULL,'upload/onlive/63/2012100816113448610.jpg','关于礼仪',NULL,NULL,NULL,NULL,NULL,NULL,63,3,0,1),(8,'2012-10-08 16:18:49',NULL,'  你整天呆在写字楼里，整天对着电脑是不是觉得很压抑，很我聊，走进大自然，探索大自然的奥秘。',NULL,'upload/onlive/63/2012100816153470812.jpg','大自然的奥秘',NULL,NULL,NULL,NULL,NULL,NULL,63,3,132,1),(9,'2012-10-08 16:32:17',NULL,'  分析谈恋爱的好与坏',NULL,'upload/onlive/63/2012100816304543007.jpg',' 你同意大学谈恋爱吗？',NULL,NULL,NULL,NULL,NULL,NULL,63,3,134,1),(10,'2012-10-08 16:40:16',NULL,'  你觉得失败是成功之母吗？',NULL,'upload/onlive/63/2012100816394483599.jpg','失败是成功之母吗？',NULL,NULL,NULL,NULL,NULL,NULL,63,3,162,1),(11,'2012-10-09 06:38:36',NULL,'  在不同地方帮你看天气',NULL,'upload/onlive/63/2012100906374575256.jpg','看云识天气',NULL,NULL,NULL,35,NULL,NULL,63,3,0,1),(12,'2012-10-09 06:42:16',NULL,'  在不同地方帮你看天气',NULL,'upload/onlive/63/2012100906385783084.jpg','看云识天气',NULL,NULL,NULL,35,NULL,NULL,63,3,131,1);
