INSERT INTO `livetrailer` VALUES (1,'<p>\r\n	sdfsdfsf</p>\r\n','2012-10-01 07:00:51','ttt',6),(2,'<p>\r\n	转播新加坡国大的名师讲座，现场直播。</p>\r\n','2012-10-08 03:55:53','新加坡国大讲座',6),(3,'<p>\r\n	这是乐队成员对他的评价，我们也一起说一说曾经无数次触动过我们心弦的许巍。</p>\r\n<p>\r\n	<strong style=\"color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">大师、自由、平和、创新</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　<strong>吉他手</strong>李延亮<strong>：</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　我眼中的许巍是弦乐大师，他的和弦千变万化。现在的他越来越沉静、大气。他的歌看似简单却有差异，平静中却不失力量。我觉得他区别于一般的流行歌手，他依然是一个主唱，他的表演形式还是乐队，带着他的乐队唱歌。</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　<strong>键盘手贝贝：</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　许巍老师给我的感觉是非常自由，所以我弹得也非常自由。我从小就听许巍的歌，我觉得他有别于一般的摇滚乐手，有自己的个性。他的歌写得特别好，有自己的见解和特征。我觉得他的人和音乐一样，非常有个性，但是非常平和。</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　<strong>贝司手</strong>李剑<strong>：</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　我最早和他合作是在第三张专辑，参与了录制。现在他一场比一场做得好。以前更多的是激情，现在对音色控制得很好。我觉得他是一个很平和的人，他的音乐和人一样平和。我个人更喜欢他的词，他的词很贴近生活，很能打动人。他的歌没有特别的年龄界限，不像一般的流行歌手面对的就是孩子，许巍的歌面对所有人。</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　<strong>吉他工程师高铄：</strong></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(69, 69, 69); font-family: \'Microsoft Yahei\', 微软雅黑, Tahoma, Arial, Helvetica, STHeiti; font-size: 14px; line-height: 21px; \">\r\n	　　许巍大哥是我的老大哥之一，我认识他有几年了，但是真正加入这团队是在今年年初，因为琴在南北声音会不一样，我就负责调琴。我觉得他很自然、平和、认真，也很容易抓住时间的脉搏。许氏音乐会会让人内心很舒服。许巍大哥一直在创新、不停滞。他的心中充满爱，所以首首是经典。</p>\r\n','2012-10-11 09:11:41','说说许巍和他的歌',152),(4,'<p>\r\n	知元互动也可以应用于实时监测系统。此图像为某全球著名学府的一个实验室大门的实时图像，大家有兴趣可以看看。</p>\r\n','2012-10-12 07:11:46','实时在线监测',6);
